    'Америка. Маленький городишко. Парикмахерская. Парихмахер стрижет своего постоянного клиента.\n— Какие планы на отпуск, старина? — спрашивает он у него.\n— Хочу побывать в Москве, — отвечает тот.\n— В Москве!!! В этом грязном, вонючем городе, где мусор не убирают и по улице ходят бандиты и медведи! Да вы что, сэр?! Не вздумайте!!!\n— И все–таки я поеду. Ведь мои дедушка и бабушка когда–то жили там!\n— А какими авиалиниями летишь? — спрашивает парихмахер.\n— Аэрофлотом! — отвечает тот.\n— Мама дорогая, это самые поганые авиалинии. Там воняет керосином, ужасная теснота и отвратительная еда. Пару часов опоздания вам гарантировано.\n— И все–таки я еду!\n— Ну ладно, а в какой гостинице вы остановитесь в Москве?\n— В “России”!\n— Какой кошмар! Там куча проституток, ломовые цены, кругом тараканы и мерзопакосный персонал.\n— Я еду, в любом случае!\n— А что же вы будете делать в Москве? — не унимается парихмахер.\n— Хочу сходить в Мавзолей Ленина! –??????. Там же огромная очередь, кругом милиция и шмон. Мерзко и противно!\n— Меня ничто не остановит! — отвечает клиент.\nЧерез пару месяцев, после поездки он приходит в парихмахерскую.\n— Привет, дружище, — говорит парихмахер, — как поездка? Правду ли я вам говорил про Москву?\n— Знаете, Москва мне очень понравилась. У них новый мэр Лужков и он навел там порядок. Кругом чистота, криминала мало и медведей я не видел!\n— Ну, а Аэрофлот как? Все, как я сказал?\n— Не совсем. Самолет был почти пустой, так что нас пересадили в 1–й класс. Кормили отменно и стюардесса была очень милой и симпатичной девушкой.\n— Ну, а гостиница, правда, дрянь?!\n— Что вы! Они там недавно сделали ремонт и была неделя скидок, так что я жил в номере люкс! Никаких проституток и тараканов.\n— Ну, а Ленина–то видели? — не унимается парихмахер.\n— Представьте себе, видел. И вы даже не поверите. Стою я в очереди, вдруг подходит человек в штатском, отводит меня в сторону и говорит, что их ученые только что совершили чудо и смогли оживить Ленина, и что он хочет поговорить с кем–нибудь из толпы. И они выбрали меня для этой цели.\n— Боже, ушам своим не верю! И что же Ленин вам сказал?\n— Да всего пару слов: “Батенька, и кто же это вас так хуево подстриг…?”',
    'Поймал Дракон в лесу Волка, говорит ему: \n — Смотри, записываю: "Волк серый, одна штука". Сегодня придешь ко мне на обед, я тебя съем. Понял? \n — Понял. \n — Вопросы есть? \n — Нет \nПошел Волк понурый. Идёт дальше Дракон по лесу. Поймал Лису. \n — Смотри, Рыжая, записываю: "Лиса рыжая, хвостатая, одна штука". Сегодня придёшь ко мне на обед, я тебя съем. Поняла? \n — Поняла \n — Вопросы есть? \n — Нет \nПошла Лиса грустная. А Дракон дальше идёт. Поймал Зайца, говорит: \n — Смотри, Косой, записываю: "Заяц серый, уши длинные, одна штука". Завтра придёшь ко мне на завтрак, я тебя съем. Понял? \n — Понял \n — Вопросы есть? \n — Есть. \n — Задавай! \n — А можно не приходить? \n — Можно. Вычёркиваю!',
