    'Мужик приходит к тату-мастеру и говорит:\n-А набей мне на всю спину танк\n-Да не вопрос, ложись\nПроходит 15 минут, тату-мастер говорит:\n-Ну всё, готово\n-А почему я встать не могу?\n-А хули ты хотел? 46 тонн!',
    'Остановка. Подходит автобус. Интеллигентного вида человек пропускает всех вперед. Сам пытается зайти последним. И ему дверью придавливает шею. \nАвтобус трогается. \n- Блять!!! Пиздец!!! Ёбаный в рот!!! Стой на хуй!!! Охуели пидарасы!!! \nОторвете к ебеням же голову!!! \nВодитель тормозит, открывает дверь. Чел заходит в салон, поправляет \nгалстук и обращается ко всем: \n- Извините. Был напуган.',
