    'Винни-пух с Пятачком приходят 1-го сентября в школу. Ну, тут, как водится, сочинение — "Как я провел лето". Пятачок говорит:\n— Винни, а что мы писать будем? Мы ведь все лето целыми днями "план" курили, а больше ничего не делали. Винни-пух подумал и говорит:\n— А ты, Пятачок, вместо слова "курили" пиши "читали". Читали целое лето — это же хорошо.\nНу ладно, написали они это дело. Проверяют работу Пятачка: "Проснулся я как-то утром. Почитал. Пошел умылся. Почитал. Перед завтраком еще немного почитал. Позавтракал. До обеда читал. Пообедал. Чего-то мне спать захотелось. Ну, перед сном почитал. Дочитал книжку. Поспал.Проснулся, почитал. Тут Винни-пух пришел. Сразу видно — читал. Ну мы с ним на балкон пошли. Стоим, читаем. Тут внизу Иа-Иа идет и кричит: "У вас есть что почитать?" А сам такой начитанный-начитанный, и еще пол-Букваря за ухом торчит".',
