    'У сторонников и противников вакцинации есть одна общая черта: и те и другие уверены, что долбоёбы вымрут.',
    '— Доктор, мне везде мерещатся анекдоты. \n— А какое у вас зрение? \n— Кажется, 2.\n— +2 или -2?',
    'Решили ученые сделать робота-драмера. Ну, соорудили конструкцию. Параметр "Интеллект" выкрутили на 100%, посадили за установку дали в руки палки... А робот — ни движения. Понизили "Интеллект" до 50%, робот выдал "тунц-тыщ-тунц-тыщ" Ученые начали радоваццо, опять снизили "Интеллект", но в этот раз — до 25%. Робот начал выдавать прикольные партии. Ну, ученые думают: "Ооо, ништяк, а если на ноль поставим, то ваще трэш начнеццо". И поставили. Робот встал и взял бас.',
    'СССР. Приезжает Брежнев в Колхоз. Видит косец сено косит.\nПодходит Генсек к косцу и говорит:\n— Не рационально работаешь, возьми две косы и коси в обе стороны!\nПриезжает Брежнев ещё раз. Косец косит двумя косами.\nПодходит Генсек к косцу и говорит:\n— Не рационально работаешь, повесь на жопу грабли и убирай за собой сено!\nПриезжает Брежнев ещё раз. Косец косит. Грабли у косца на жопе, сено гребут. Генсек идет к косцу, а тот удирать… Охрана догнала, привела к Брежневу.\nТот спрашивает:\n— Ты зачем убегаешь, я хотел тебе орден вручить!\nКосец отвечает:\n— А я думал, Вы заставите повесить мне на член фонарь и работать в ночную смену',
    'Один мудрый сенсей 15 лет обучал своего ученика. И вот, наконец, сенсей решил что пришла пора для финального испытания. Пошли они с учеником в лес. Сначала на пути учителю и его подопечному встретились волки. Ученик сразу бросился в бой, начал сыпать всеми приемами подряд. Но волки одерживали верх. Тогда ученик оглянулся на сенсея. Сенсей лишь улыбнулся и сказал: \n\n-Ты, подобно человеку идущему против ветра, идёшь напролом. Попробуй анализировать их атаки и заходить сбоку.\n\nПосле совета сенсея, его подопечный без проблем разделался с волками. Пошли они дальше и набрели на разбойника. Ученик ринулся в бой, но опять сколько бы он не сражался, результата не было. Ученик оглянулся на учителя:\n\n-Ты, подобно птице в шторм, не экономишь силы. Заставь его выдохнуться\n\nПосле совета сенсея, ученик без труда одолел разбойника. Пошли эти двое дальше, а на встречу им шесть воров с ножами. Ученик, по обыкновению, сразу ринулся в бой, но их было много и ученик проигрывал. Тогда он оглянулся и понял что сенсей дал по сьебам.',
    'Беспилотник США прилетел в Россию на разведку, а вернулся с установленным пакетом яндекс приложений',
    'Летит самолет домой (транспортник, летит из южных стран), ну понятное дело экипаж фруктов набрал, овощей разных, весь борт забит до отказа, взлетают значит.\n500 метров до конца полосы нет отрыва, 300 метров нет отрыва, 100 метров нет отрыва, 5 метров - фух, есть отрыв. Командир, весь в поту, поворачивается к штурману:\n-Блять еще ведро черешни могли взять.',
    'Дворик в клинике для душевнобольных, на лужайке сидит псих и увлеченно пробивает с помощью гвоздя и молотка отверстия в новом оцинкованном ведре. Мимо по дорожке идет врач, останавливается напротив больного и ласково так:\n— И чем же мы тут занимаемся?\n— Да вот, бульбометр делаю.\n— ??? !!!\n— Ну, воду в него наливаешь, она из дырочек выливается и булькает. Вот эти бульки и считаешь. Бульбометр одним словом... — объясняет пациент.\n— Ха-ха-ха! Ну, закончил? — врач забирает молоток с гвоздем, а дырявое ведро перекидывает через бетонный забор.\nА за забором с психушкой соседствует воинская часть, ведро падает прямо на плац, в это время по плацу идет злой прапор, только что получивший нагоняй от начальства:\n— Блядь! Не часть, а сплошной бардак! Кругом бычки, мусор! (поднимая ведро)\n— Во! Ещё и бульбометр новый кто-то выкинул...',
    'Ушел мужик в монастырь, дал обет молчания, но раз в 10 лет можно было сказать два слова.\nПрошло 10 лет.\n- Еда говно.\nПрошло ещё 10.\n- Кровать жесткая.\nЕщё через 10 подходит к настоятелю и говорит:\n- Я ухожу.\n- Ну оно и понятно, жаловался ты дохуя.',
    'Заселяется первокурсник в общагу, старшак ему экскурсию проводит, доходит до кухни, говорит: \n- А это плита, только духовку не открывай, нельзя \n- Почему это? \n- Если расскажу, все равно не поверишь, нельзя и все тут. \nПервокурснику стало любопытно, и вот он после отбоя крадётся к плите, открывает духовку, а там сидит внутри на диване огромный таракан, перед ним маленький телевизор включен, пиво на столике, закусь лежит. Он поворачивается на первака и орет: \n- АААААААА БЛЯТЬ НАХУЙ!!!!!!',
    'Научил попугая говорить "Чурка". Извиняться ему пришлось учиться самому.',
    'В семье потомственных пулемётчиков умер отец.\nДля них это была настоящая утрататататататата',
    'В класс заходит новый учитель с огромным косяком, садится, запаливает, тянет… \n— Дети, я ваш новый учитель биологии, Петр Сергеевич… \nЗатягивается, выдыхает… \n— Сегодня я расскажу вам про рыбу-пилу… \nЗатягивается… \n— Эта рыба обитает на са–а–амом дне океана, у дна, в вечной мгле… \n…еще тяжка… \n— Но иногда она выходит на берег, и начинает пилить деревья… \nЗатягивается, выдыхает… задумчиво: \n— Курить люблю пиздец',
    'Откинулся как-то зэк с зоны, зашел в ресторан, зовет кудрявую официантку: \n- Эй ты, в натуре, иди сда! \n- Чего изволите? \n- Чифира давай, поняла! \n- Извините, а что это такое? \n- Hy ты че, шалава ебаная, охуела в натуре?!? Не принесёшь через 5 минут - на перо посажу!!! \nОфициантка прибегает к повару вся в слезах, говорит: \n-Там какой-то еблан чифиру заказал, зарезать грозил, если через пять минут чифиру не принесу. А я даже не знаю, что это такое. \nПовар отвечает: \n- Не печалься, сейчас сделаю, через 5 минут подашь.\nВ общем, сделал чифир, приносит она его зэку. Зэк отхлебнул маленько, поморщился. \nИ тут его глаза округлились, он резко загрустил, по щеке покатилась скупая слеза. Он поднял взгляд на официантку, внимательно всмотрелся в неё и дрожащим голосом спросил: \n-Хова? Ты?',
    'Играет маленькая девочка в песочнице. Мимо идет мужик. Она ему:\n- Дяденька, скажи «раз»!\n- Раз.\n- Ты – пидорас! Ха-ха-ха!!!\nИ убежала.\nНа следующий день мужик опять проходит мимо. Девочка ему:\n- Дяденька, скажи «три»!\n- Три.\n- Пидорас – это ты! Ха-ха-ха!!!\nИ убежала.\nНа третий день мужик опять проходит мимо. Девочка ему снова:\n- Дяденька, скажи «пять»!\n- Пять.\n- Пидорас ты опять! Ха-ха-ха!!!\nИ убежала.\nНа следующий день мужик подходит к ней и говорит:\n- Девочка, скажи сто.\n- Сто.\n- Сто хуев тебе в панамку!\n- Так ведь не складно!\n- Вот сиди и складывай!!!',
    'Одесский еврей предложил растянуть сетку над Киевом чтобы ловить русские снаряды и продавать их.',
    'Дама разводится с мужем.\nСудья спрашивает даму:\n- Какова причина развода?\n- Ну….\n- Он пьет?\n- Нет.\n- Наркотики?\n- Нет.\n- Мало зарабатывает?\n- Да в общем, нет.\n- Бьет?\n- Нет.\n- Не заботится о детях?\n- Заботится.\n- Изменяет?\n- Нет, что вы!\n- Не удовлетворяет вас как женщину?\n- Нет, с этим все нормально.\n- Не помогает по дому?\n- Помогает.\n- Тогда в чем же причина?\n- Понимаете, гражданин судья, все что нужно он делает… но… вы бы видели, с каким лицом он это делает ….',
    'Городок в западно-американской степи. Салун. За столом сидят два ковбоя, местный и приезжий, и пьют виски. Вдруг по улице кто-то проносится на огромной скорости, паля во все стороны из револьверов. В салуне никто и ухом не ведёт. Приезжий местному: \n— Билли? \n— Да, Гарри? \n— Что это было, Билли? \n— Это был Неуловимый Джо, Гарри. \n— А почему его зовут Неуловимым Джо, Билли? \n— Потому что его никто ещё не поймал, Гарри. \n— А почему его никто ещё не поймал, Билли? \n— Потому что он нахуй никому не нужен, Гарри.',
    'Мой дед говорил так- когда одна дверь закрывается, другая открывается. Хороший был дед, а вот шкафы плохо собирал.',
    'Приехал каратист в деревню, мужики к нему подходят и начинают докапываться, типо: "Покажи приёмчик", тот в отказ, мол отдыхать приехал, а не драться, деревенские не сдаются и он не соглашается.\nИдут мужики к самому сильному и драчливому, кузнецу Ивану зовут его, чтобы каратиста на драку вывести.\nПриходит Иван к каратисту, начинает на него с кулаками кидаться, каратист херак и вырубил Ивана. Мужики к Ване подбегают бьют его по щекам, водой поливают. Иван открывает один глаз спрашивает: "Каратист ушёл?" \nмужики: "Нет, вон рядом стоит" \nИван:"Сейчас уйдёт я всем вам пизды дам"',
    'Летят десантники в самолете, выходит к ним офицер и говорит:\n- Парни, все летим в Афган воевать.\nПарни помрачнели так... Но офицер продолжает:\n- Но за голову каждого убитого душмана будем выплачивать премию - 100 советских рублей!\nСамолет заходит на посадку, десантники врассыпную. Офицер в одиночестве, стоит возле самолета. Через 30 минут десантники возвращаются, тащат связки голов. Офицер стоит у ужасе:\n- Ребята, мы же в Ташкенте сели для дозаправки',
    'Идет девочка лет десяти по улице. Вся в белом. Платьице белое, белые гольфики, бантики белые. Белая собачка на белом поводочке. Идет такая по улице радостная. Вдруг отодвигается крышка канализационного люка и вылезает дядя Петя сантехник весь в дерьмище и начинает отряхиваться. Все говно летит на девочку, на бантики, на платьице, на собачку. Девочка со слезами: \n - Дяденька, за что?\n - Аааа, Не нравится? А срать тебе нравится?',
    'На одном корабле работал фокусник. Так как пассажиры постоянно\nменялись, он без перемены проделывал одни и те же фокусы.\nК его несчастью, капитанский попугай просмотрел его выступление\nдостаточно раз и разгадал все секреты. Во время каждого\nвыступления попугай портил все фокусы своими криками "Эта не та\nшляпа! Он прячет пиковую даму в кармане брюк ! В коробке дырочка!"\nФокусник сердился, но ничего не мог сделать, капитанский попугай\nвсе-таки. Однажды корабль потерпел кораблекрушение, и только\nфокусник и попугай выжили чудом, и продолжали плавать в море на\nкаком-то бревне. Фокусник постоянно злобно смотрел на попугая,\nкоторый в свою очередь не переставал смотреть на фокусника.\nНаконец, через неделю попугай не выдержал:\n- Ну ладно, ладно, я сдаюсь! где корабль?!?',
    'Скачет Илья Муромец по пустыне, устал, силы на исходе, видит, вдали оазис вода и еда, и там же Змей Горыныч. Илья Муромец достал свой меч и в бой со Змеем Горынычем, бьётся день и ночь с ним в жестоком бою, на третий день Змей Горыныч спрашивает у Богатыря:\n— Да что ж тебе надо от меня?\n— Да пить я хочу.\n— Да пей, х*ли ты доебался-то?!',
    'Идут парень с девушкой. Вокруг красота, птички поют. Парень намекает- давай в лесок зайдём. Нашли подходящую полянку и разложились на плесень и на липовый мёд',
    'Bстречаются двое: — Привет, слыхал, что Петрович умер? — Нет а как? — Пьяный домой пришел — Сердце встало? — Да нет, он дома покурить решил и квартира загорелась — Сгорел? — Нет, он пожарников вызвал и в окно выпрыгнул — Разбился? — Не... там пожарники тент расстелили и его обратно в окно — Так все-таки сгорел? — Нет... он мимо окна пролетал и за подоконник зацепился ну и обратно — Так значит все-таки разбился? — Нет, там же тент его на дорогу откинуло — Так значит сбило... — Да нет там камаз батуты вез его обратно в окно откинуло — Так все таки сгорел???!!! — Да нет, застрелили его — Как так? — Да заебал туда сюда летать.',
    'Колхоз, 30-е годы. В клубе судят тракториста, по пьянке утопившего трактор в болоте.\nВ тюрьму сажать нельзя - колхоз без тракториста останется и наказать надо.\nПредседатель:\n- Ну что товарищи с ним делать будем?\nТянет руку кузнец, здоровенный парень:\n-А давайте я его по башке ебну.\nПредседатель:\n- Ты такой здоровый, его ебнешь и он помрет от этого, а у нас трактористов больше нет.\nСидят, дальше обсуждают. Кузнец опять тянет руку.\n- Ну чего тебе?\n- А давайте я хохлу ебну, у нас их все равно двое.',
    'Америка. Маленький городишко. Парикмахерская. Парикмахер стрижет своего постоянного клиента.\n\n— Какие планы на отпуск, старина?\n\n— Хочу побывать в Москве...\n\n— В Москве!!! В этом грязном, вонючем городе, где мусор не убирают и по улице ходят бандиты и медведи! Да вы что, сэр?! Hе вздумайте!!!\n\n— И все-таки я поеду. Ведь мои дедушка и бабушка когда-то жили там!\n\n— А какими авиалиниями летишь?\n\n— Аэрофлотом!\n\n— Мама дорогая, это самые поганые авиалинии. Там воняет керосином, ужасная теснота и отвратительная еда. Пару часов опоздания вам гарантировано!\n\n— И все-таки я еду!\n\n— Ну ладно, а в какой гостинице вы остановитесь в Москве?\n\n— В "России"!\n\n— Какой кошмар! Там куча проституток, ломовые цены, кругом тараканы и мерзопакостный персонал.\n\n— Я еду, в любом случае!\n\n— А что же вы будете делать в Москве?\n\n— Хочу сходить в Мавзолей Ленина!\n\n— Там же огромная очередь, кругом милиция и шмон. Мерзко и противно!\n\n— Меня ничто не остановит! - отвечает клиент.\n\nЧерез пару месяцев, после поездки он приходит в парикмахерскую.\n\n— Привет, дружище, - говорит парихмахер, - как поездка? Правду ли я вам говорил про Москву?\n\n— Знаете, Москва мне очень понравилась. У них новый мэр Лужков и он навел там порядок. Кругом чистота, криминала мало и медведей я не видел!\n\n— Ну, а Аэрофлот как? Все, как я сказал?\n\n— Не совсем. Самолет был почти пустой, так что нас пересадили в 1-й класс. Кормили отменно и стюардесса была очень милой и симпатичной девушкой.\n\n— Ну, а гостиница, правда, дрянь?!\n\n— Что вы! Они там недавно сделали ремонт и была неделя скидок, так что я жил в номере люкс! Никаких проституток и тараканов.\n\n— Ну, а Ленина-то видели? - не унимается парикмахер.\n\n— Представьте себе, видел. И вы даже не поверите. Стою я в очереди, вдруг подходит человек в штатском, отводит меня в сторону и говорит, что их ученые только что совершили чудо и смогли оживить Ленина, и что он хочет поговорить с кем-нибудь из толпы, и они выбрали меня для этой цели.\n\n— Боже, ушам своим не верю! И что же Ленин вам сказал?\n\n— Да всего пару слов: "Батенька, и кто же это вас так х*ево подстгиг?"',
    'Таможенник поднимается на корабль для досмотра.\n- Наркотики есть?\nХозяин корабля отвечает:\n- Есть. Вот, пожалуйста (достает чемодан). Вот героин, вот кокаин.\nВсе аккуратно упаковано,вот шприц готовый.\nТаможенник, вытаращив глаза:\n- А может, и оружие есть?\nХозяин (достает другой чемодан):\n- Вот макаров, вот калашник ,вот патроны к ним. Все как надо.\nТаможенник с усмешкой:\n- Наверное, и валюта есть?\nХозяин достает третий чемодан:\n- Вот миллион долларов, пожалуйста.\nТаможенник, ничего не понимая:\n- И это все ваше?\nХозяин:\n- Нет, это ваше. Мое в трюме.',
    'Едет машина скорой помощи, внутри водитель, врач, фельдшей, медсестра и студент практикант. Едут, вдруг водитель резко тормозит и начинает задыхаться. Хватается руками за горло, шипит - ужасное зрелище. Медсестра невозмутимо и твердо хватает чемоданчик с препаратами и бьет водителя по голове. Тот моментально успокаивается и машина продолжает движение. Тут фельдшер хватается за горло, падает на пол, начинает задыхаться и сипеть. Медсестра зло бьет фельдшера по голове и тот сразу оправляется и садится на место. Не прошло и минуты, как врач начинает задыхаться и брыкаться на полу. Медсестра резким ударом чемоданчика приводит врача в чувства. Обалдевший от увиденного студент спрашивает у врача: \n- Я учусь только на 4 курсе и все мои знания - это сплошная теория, но о подобных симптомах я даже не слышал! А метод лечения настолько странный, что я окончательно растерян, не могли бы вы мне объяснить.. \nВрач, махая рукой: \n- А, не бери в голову. У медсестры муж вчера повесился, мы ее подъебываем',
    'Приезжает руский учитель в Украину по работе.\nЗаходит в класс и думает, блять, а кого спашивать',
    'Математик пришел к своему врачу:\n- Доктор, я влюбился в девушку-физика. Вы должны помочь мне стать физиком!\n- Вы уверены? – спросил доктор. – Для этого придется сделать операцию и удалить половину вашего мозга.\nМатематик сказал, что это неважно, он готов на все.\nПроснувшись после операции, он увидел доктора возле своей кровати.\n- Я очень сильно извиняюсь, - сказал доктор. - Мы совершили ужасную ошибку. Мы удалили 99,9% вашего мозга.\nПарень ударил себя по лбу и закричал:\n- О нет! Вы удалили мне весь мозг!\n- Поздравляю, вы физик!',
    'Глухонемой водитель на перекрёстке отчаянно пытается понять, почему регулировщик шлёт его нахуй.',
    'У армянского математика родился сын. Он назвал его График.',
    'Два украинца на волах едут на базар. Волы идут медленно. Один\nподсел в телегу к другому: \n– Грицько, ты зачем на базар едешь? \n– Самогон везу продавать. \n– И я везу самогон. А ты почем будешь продавать? \n– Да по рублю стакан. \n– И я по рублю стакан. Слушай, вот тебе рубль, дай мне твоего самогона попробовать. \nПопробовал. \n– Слухай, Петро, вот тебе рубль обратно, дай и мне твоего самогона\nпопробовать. \nПопробовал. \n– Грицько! Гарний у тебя самогон. Дай еще стакан, вот тебе рубль. \nИ так далее. Пробовали, пробовали, самогон у обоих кончился. \nПришлось повернуть обратно. \n– Как же так получается? Целый день так бойко торговали, а у нас\nкак был один рубль на двоих, так и остался?',
    'Сидит субботним утром семья, завтракают... Вдруг у взрослых желание сексуальное разыгралось, они быстренько перемигнулись ... Жена тут же встает из-за стола и говорит:\n\n- Что-то у меня аппетит пропал, я доедать не буду.\n\nИ поднимается на второй этаж, в спальню. Муж быстренько доел, вскочил и тоже бегом в спальню. Дети никак не поймут, что с родителями происходит. Старший говорит младшему:\n\n- А ну-ка сбегай на второй этаж, посмотри, что там такое.\n\nМладший поднимается, потом возвращается бегом, садится за стол и начинает быстро-быстро есть. Старший спрашивает:\n\n- Что случилось, чего это ты так быстро ешь?\n\n- Там наверху, тех, кто не доедает, папа в жопу ебет',
    'Идут на встречу друг другу заика и горбатый. Заика спрашивает:\n- С-си-гга-реткки не ббудет?\nГорбатый:\n- Ннет, ннне ббудет!\nЗаика:\n- А в рюкзачке?',
    'Нигилист начал отрицать нигилизм и анигилировался',
    'Медведь попал в смертельную аварию и чудом выжил.\n"Чудес не бывает", - подумал Медведь и залез обратно в горящую машину.',
    'Тащит прапор тачку с говном, навстречу ему майор:\n- Чё тащешь?\n- Да вот говно везу.\nНу майор не поверил, как так, прапор и ниче не спиздил, решил проверить. Рукава засучил и в говне начал руками лазить, ессно ничего не нашёл. Идёт прапор дальше, навстречу ему полковник. Ну там такая же фигня происходит.\nПотом навстречу ему генерал, тоже не поверил, полазил в говне полазиз, ничего не нашёл. "Ну- думает - прапор наш исправляется, ничего не спиздил".\nПрапор выходит с базы:\n- Чё спиздил, чё спиздил. Вываливает говно из тачки. Тачку спиздил!!!',
    'Двое кавказцев играют в шахматы. Один ставит своего ферзя на середину поля: \n– Мат! \nВторой ставит рядом своего короля: \n– Отэц!',
    'Встречаются три проститутки. Выпили и давай спорить, кто лучше: военный, колхозник или студент... Спорили, спорили и решили попробовать по одному и потом встретиться, да поделиться впечатлениями. \nНа следующий день:\n- Я с колхозником думала с ума сойду. Сначала корову доили в четыре руки, потом пошли на сеновал, он одну палку кинул и убежал курей кормить.\nВторая:\n- А я со студентом 4 часа на парах просидела, потом он в буфете булочки жрал, в общагу отвел, за сиськи подержал и убежал уроки делать.\nТретья:\n- Бля, девки, ну вы хоть кайфанули, а я с военным 3 литра водки на двоих выпила,  затем мы 2 часа от караула бегали, потом он меня к забору раком поставил, я говорю: "давай хоть колготки сниму", а он: "не надо, я и так перелезу".',
    'Священник тонет в океане. Вдруг мимо проплывает лодка, и рыбак кричит: "Вам нужна помощь?" Священник отвечает: "Нет, Бог спасёт меня". Через какое-то время мимо проплывает ещё одна лодка, рыбак спрашивает: "Эй, вам помочь?" Священник снова отвечает: "Нет, Бог спасёт меня". В конце концов священник умирает и попадает в рай. Он спрашивает Бога: "Почему ты не спас меня, Боже?" Бог отвечает: "Ты долбоёб? Я тебе две лодки послал!"',
    'XIX век. Россия. Поезд Москва - Петербург. Вагон. Купе. На третьей полке дрыхнет денщик. \nНа первой - боевой генерал, весь в медалях, на второй - поп,напротив - попадья с дочкой. \nГрохот, треск. Сверзается вниз денщик: \n- Господин генерал, разрешите поссать. \n- Иди. \nКряхтя, спускается поп. \n- Ну как ему не стыдно! Вот вы, боевой генерал, грудь медалями украшена, кровь за родину проливали, а он при вас - поссать. Я, святой отец, за дела ваши грешные молюся, лысину учением нажил, а он при мне - поссать. Жена моя, честная женщина, девушкой за меня вышла, не изменяла ни разу, дочь родила, а он при ней - поссать. Дочь моя, голубица непорочная, греха не знающая, а он при ней поссать. \n- Ну успокойся, папаша, внушение сделаю. \nГрохот, треск. Врывается денщик. \n- Господин генерал, разрешите доложить - поссал! \nГенерал, со строгим видом: \n- Ах ты, ёб твою мать, пиздоглазое мудоёбище! Я тебе кто, боевой генерал, или хуй собачий? Кровь за Родину проливал, грудь медалями расхуячена, а ты при мне - поссать. Это тебе что, конская залупа на солнце блестит, или лысина отца святого за дела наши блядские лоб расшибшего? А ты при нём что - поссать. Это тебе кто, блядь подзаборная, или жена отца святого, пизду соседу не дававшая, дочь невесть как породившая, а ты при ей поссать... Это, по твоему, кто, потаскуха малолетняя или дочь отца святого, греха не знающая, хуя во рту не державшая, а ты при ней что - поссать!.. Марш на третью полку и не ссать до самого Петербурга!',
    'Купил физрук шляпу, а она ему как раз два три раз два три раз два три закончили',
    'В дверь постучали 9/10 раз.\n«Колгейт» - подумал Штирлиц.',
    'Боксер вырубил двух хулиганов на улице. Приехало телевидение, берут у него интервью:\n- Скажите, что произошло?\n- Иду я по улице, никого не трогаю...Вдруг подваливают ко мне два типа, начинают требовать деньги...\n- И что же дальше?\n- Ну я первого с правой вырубаю.\n- А второго?\n- А второго у меня день рождения!',
    'В центре Лондоне по узкой улочке навстречу друг другу едут шикарные лимузины. Дорогу уступать никто не хочет. Наконец, они, едва не столкнувшись, останавливаются. Из одной машины выскакивает ниггер, из другой чинно выходит англичанин. Ниггер начинает, бешено жестикулируя, орать: \n– Ты, бля, куда!? Куда ты лезешь? Да ты знаешь, кого я везу?! \nАнгличанин невозмутимо достает трубку, набивает ее и начинает раскуривать. \nНиггер не унимается: \n– Лох! У меня в машине сидит сам Билл Гейтс! И если ты…! \nПроходит некоторое время. Англичанин курит, ниггер орет. \nНаконец, англичанин докуривает, выбивает золу из трубки, обходит свой лимузин и открывает заднюю дверь. На заднем сиденье тихо вяжет английская Королева. \nАнгличанин: \n– А это, что, по-вашему – залупа конская?',
    'Заходит хохол в пидорский клуб, бармен наливает коктейль. Хохол пригубил.\n— Какая вкуснятина! Как называется?\n— Это "Хуй в сале"!\n— Надо же, сало вообще не чувствуется!',
    'Грузинская свадьба. Один из гостей обращается к своему соседу: \n- Послюшай, дарагой. Я был на многих свадьбах, но нигде не видел такой нэвэста. Это мужчина или женщина. \n- Я тэбя здэсь зарэжю! Это мой дочь!!! \n- Вах! Прости, дарагой! Я не знал, что ты отэц этой красавицы! \n- Все! Тэбе пиздец! Я ее мат!',
    'Группа опытных археологов во время раскопок нашла группу неопытных',
    'В японской национальной кухне появилось новое блюдо с названием\n"СССР". Это одна шестая часть суши.',
    'Мюлер зашёл в свой кабинет и увидел Штирлица роющевася в его сейфе.\n-Что вы здесь делаете?!\nСпросил Мюлер.\n-Жду трамвая.\nОтветил Штирлиц.\nМюлер в недоумении закрыл дверь и задумался: "Какой может быть трамвай в моём кабинете?". Он снова заглянул в свой кабинет, но Штирлица там уже не было.\n-Уехал.\nПодумал Мюлер.',
    'Кафе недалеко от больницы. Каждый день его посещает мужик и заказывает два стакана водки. \nОбъясняет буфетчице:\n- Мой друг в больнице, я пью за себя и за него. \nВ очередной раз приходит и заказывает один стакан. \n- Что, неужели друг умер? \n- Да нет, просто я пить бросил.',
    'Приезжает цирк в город. Там афиша- у нас в первые в жизни вы увидите шок: летающие крокодилы. \nСобрался полный купол народа, тут директор объявляет:\n—А сейчас на ваших глазах, летающиииее крокодилы!!!\nИз-за кулис вылетают крокодилы, по залу пархают, все замерли\nОдин крокодил на руке к девочки садится\n-крокодил крокодил а как у вач получается летать?\n-эх девочка если бы ты знала как нас тут хуярят',
    'В Алабаме снова перепутали поезда и продали 20 кусков угля и сожгли 450кг негров.',
    'Peшили свapщики отмeтить дeнь рождения коллеги. И, чтобы не спалиться в рабочий день, они набили робу ветошью, привязали держак к руке и оставили чучело на высоте создавать видимость рабочего процесса. Ветер дует, держак с электродом качается, чучело типа варит — ну а сварщики бухают. Выходит начальство из столовой, смотрят все нормально, все при деле. И тyт oт пopыва вeтpa чyчело сдувает с высоты 70 метров. Все начальство хватается за сердце, бегут к нему. Сварщик, видя это действо, спускается вниз, выкидывает чучело и ложится на его место. Прибегает начальство и видит — сварщик встает, отряхивается и говoрит: "Хуй я бoльше тyдa пoлезy!!!"',
    'Летят 2 кавказца на самолёте.\nСкорость 800, 850, 900.\n— Куда гонишь, брат?\n— Меня девушка бросила, брат. Больше я никому не нужен.\n— Ты мне нужен, братишка. \nСкорость 900, 600, 300, 100.\nСамолёт падает.',
    'Устроился Еврей в компанию по импорту кабеля. Директор поручил ему купить максимум много кабеля за минимум денег. Еврей взял деньги и пропал. Неделю нет, две нет, в конце третей недели когда директор уже прощался с деньгами вернулся еврей с 1000-й фур с кабелем. Директор в диком шоке подбегает к еврею и спрашивает:\nД - Ты за сколько это все купил???\nЕ - За три рубля!!!\nД - Как за три рубля???\nЕ - Я позвонил своей тете Софе в Одессе которая занимается импортом кабеля в страну.\nД - Ну???\nЕ - Тетя Софа отправила меня к дяде Изе в Нью Йорк который занимался экспортом кабеля.\nД - Ну а дальше???\nЕ - Дядя Изя познакомил меня с директором завода по производству кабеля. Я его спрашиваю: "Уважаемый а сколько Вы мне продадите кабеля на ТРИ рубля", а он улыбается и говорит мне: "столько сколько от кончика твоего носа до кончика твоего хуя"\nД - Ну и????????\nЕ - Но он же не знал, что кончик моего хуя находится в Телявиве.',
    'Жил-был один богач. И как-то этот богач возвращался домой через поля, а там мужик работает. Ну, и присели оба в тенечке, да разговор завели.\nСпрашивает богач:\n— Слушай, мужик, вот ты пашешь, пашешь, денег-то хватает тебе?\n— Хватает, — отвечает тот.\n— А куда ты их деваешь? — не унимается богач.\n— Нуу, на одну треть долг возвращаю, еще треть в долг даю, остальное в воду бросаю, — ответил мужик и ушел дальше пахать.\nПожал плечами богач, да тоже домой поехал. Но мысль о таком странном распределении заработанных денег не давала ему покоя. Задумался сильно, аж приболел. А была у того богача жена премудрая-премудрая. И жена спрашивает, мол, что с тобой, богач. Богач поведал ей тот разговор и заключил, наверное тот мужик дурак был.\nА премудрая жена рассмеялась:\n— Тот мужик просто очень мудро изъяснился, а ты его не понял. Долг отдает, значит, родителям помогает, в долг дает — сыновей растит, а в воду бросает — дочерей растит.\nЗадумался богач и решил того мужика своим советником сделать. В тот же вечер он поехал в деревню за сто верст, с трудом разыскал дом мужика, совсем из сил выбился, смотрит, а тот монетки в речку бросает...',
    'Испытывают наши новую баллистическую ракету СС-50. А у нее блок\nнаведения отказал и улетела она куда-то в тундру. Ну, послали за ней\nпоисковую группу. Идут они по тундре, а навстречу чукча. Те у него\nспрашивают:\n- Скажи, чукча, тут 5 дней назад летела большая огненная палка.\nТы ее не видел?\n- Нет, - говорит, - однако, не видел. Самолета - летела, вертолета -\nлетела, СС-50 - летела, а большая огненная палка - не летела.',
    'Летит спецназ воевать в Казахстан.\nМимо солдат проходится лейтенант и объясняет:\n-Вы когда казаха завалите не забывайте его голову отрезать и мне\nпринести. За каждую голову $10.\nТут самолет приземляется и с оружием на изготовку солдаты выскакивают\nиз него. Час их нет, два...\nЧерез три возвращаются, все веселые, а у каждого за спиной мешок отрезаных\nголов.\nЛейтенант смотрит на них квадратными глазами и говорит:\nВы че, охуели? Мы же в Бурятии на дозаправку сели!',
    'Пупа и Лупа отправились на фронт. Во время одной из спецопераций, весь отряд был уничтожен, а Лупа умер на руках у Пупы. Он остался один, и понимал, что у него нет ни единого шанса против террористов.\nЕго окружали.\nСкупая мужская слеза текла по щеке Пупы. «Неужели все вот так закончится??» - думал он.\nНет. Я так просто не сдамся.\nБоец хватает в каждую руку по гранате, и когда боевики были рядом, выдергивает чеку.\nЗа секунду до взрыва из уст Пупы вылетают его последние слова.\n– Это вам за лупу!',
    'Монашка пошла ловить рыбу и выловила здорового леща. Проходит мимо мужик и говорит:\n— Опиздинительная рыба!\nМонашка вспыхивает:\n— Как вы себе позволяете такие выражения! Я же монашка!\nМужик смутился, решил соврать:\n— Ты меня не поняла, сестрица. Это же название рыбы.\nМонашка приходит к матушке и говорит настоятельнице:\n— Смотри, матушка, я поймала опиздинительную рыбу.\nМатушка:\n— Сестра! Как ты себе позволяешь такие выражения! Мы всё же с тобой в монастыре, а не борделе!\n— Да ведь это же название рыбы, — отвечает бедная монашка. И матушка, которая в рыбе тоже не очень разбирается, ей верит. Матушка приходит к попу и говорит:\n— Смотри, батюшка, что сестра Аграфена принесла: опиздинительная рыба!\nПоп в шоке:\n— Как ты можешь, матушка! Такие выражения!\n— Что ты, батюшка, это просто название рыбы, — говорит настоятельница, и поп, который не смог бы отличить щуку от карася, конечно же, верит.\nВечером в монастырь приезжает митрополит с проверкой. Поп усаживает его на почетное место в трапезной и, радостно потирая руки, объявляет:\n— Владыко, сегодня одна из наших сестер поймала опиздинительную рыбу. Матушка весь день готовила эту опиздинительную рыбу, а теперь мы все вместе будем эту опиздинительную рыбу есть.\nМитрополит улыбается:\n— А вы, разъебаи, нехуёво тут живете!',
    'Пасутся 2 барана:\nПервый «беееее»\nВторой «6ля тоже самое хотел сказать»',
    '-Лучшая фамилия для имени Яна?\n-Сралвпредложку',
    'Моня звонит из Израиля другу в Одессу:\n- Сеня, что там у вас творится?\n- Да Украина немножко воюет с Россией...\n- Ну и что, есть потери?\n- Да, есть... Украина потеряла Крым, пару областей, несколько самолётов и вертолётов, танков, БМП, разного там оружия, прилично народу и...\n- А что потеряли русские?\n- Моня, ты не поверишь, русские на войну ещё так и не приехали...',
    'Помидор — единственная ягода, чью гетеросексуальность защищает Ом.',
    'Василий Иванович с Петькой сидят, скучают.\nВасилий Иванович:\n- Петька, сгоняй на хутор к старику-самогонщику,\nсообрази чего-нибудь!\n- Это можно.\nЧерез час Петька возвращается.\nВасилий Иванович:\n- Ну как?\n- Да нет у него ни фига.\n- Эх, молодежь, всему вас учить надо. Пойдем вместе.\nПриходят к деду.\nВасилий Иванович:\n- Здорово, отец!\n- Здорово, сынки!\n- Мы вот к тебе от имени Советской власти. Вот я гляжу,\nхата у тебя старая.\n- Ох, какая старая!\n- Петька, запиши: новую хату ему от Советской власти! И жена\nу тебя вроде старая...\n- Ой, какая старая!!\n- Петька, запиши: новую жену ему от Советской власти!\n- Сынки! Родненькие! Да сколько ж я вас ждал!\nНу, сели за стол, выпили, с собой взяли. Уже в дверях\nВасилий Иванович как бы невзначай:\n- Слышь, дед! А может у тебя и хуй старый?\n- Уж каккой старый!!!\n- Петька, запиши: хуй ему от Советской власти!',
    'Американец, француз и русский едут в поезде, пьют водку. Американец говорит:\n— А у нас в Америке — самая развитая техника в мире. Вот Пентагон. Десять ракет, десять взлетают, десять попадают точно в цель, сантиметр в сантиметр.\nФранцуз:\n— А у нас во франции — женщины! Жена, любовница, секретарша! Сделают все, как надо!\nРусский:\n— А у нас, у дяди Вани, на хую восемнадцать воробьев помещается.\nТе двое переглянулись. Едут дальше. Напились уже. Американец:\n— Ну, конечно, иногда бывают сбои. Вот Пентагон. Десять ракет, десят взлетают, восемь попадают в цель, а две другие в космос летят.\nФранцуз:\n— Француженки, тоже мне... Жена вечно по салонам шляется, любовница со своими мужиками канителится, у секретарши на сотовый не пробиться.\nРусский:\n— А у нас, у дяди Вани, на хую восемнадцать воробьев помещается.\nАмериканец и француз еще раз переглянулись. Едут дальше. Напились в говно! Америкос:\n— Наша техника — говно. Пентагон, десять ракет, восемь взлетают, две на месте взрываются, шесть попадают в цель, а две другие в другие города летят.\nФранцуз:\n— Да! Француженки, француженки, только трындят все. На самом деле — потные, толстые, вонючие! Фу!\nРусский:\n— Ну если совсем откровенным быть, то у нас, у дяди Вани, только семнадцать воробьев помещаются, а у восемнадцатого постоянно лапка с залупы соскальзывает.',
    'Был в одном островном государстве король. И он однажды решил на единственном мосту, соединяющем его остров с землей, поставить виселицу и стража. Он спрашивал у всех, кто хотел пройти в королевство, какова его цель. Если страж считал, что он врет, то вешал его на виселице, в других случаях пропускал. Но вот однажды в королевство пришел некто с ружьем. Он зашел в палаты короля и выстрелил в него. Тот, умирая, спросил его?\n- Как наш страж пропустил тебя? Как ты ответил на вопрос?\n- Так мене навiть i не запитали.',
    'Старшина обходит строй новобранцев:\n  - У тебя какое образование?\n  - Восемь классов\n  - Хорошо. У тебя?\n  - МГУ!\n  - Чего мычишь, писать умеешь хотя бы?',
    'Парень сидит на лавочке в парке и видит, как по дорожке едет в инвалидной коляске очень красивая девушка без ног.\nПарень не может сопротивляться внезапно нахлынувшим чувствам и, подойдя к коляске, начинает знакомиться с девушкой.\nОни гуляют по парку, разговаривают, и через некоторое время парень понимает, что очень хочет эту девушку. Смотрит ей в глаза и понимает, что она тоже не против, но как осуществить желаемое?\n- Не волнуйся, - говорит девушка - там за поворотом есть забор, а в заборе гвоздик, а у меня сзади на одежде пришита петелька. ты повесишь меня за петельку и у нас все получится.\nПолчаса нежной страсти, но все хорошее когда-нибудь заканчивается... парень снимает девушку с гвоздика и нежно садит ее в коляску.\nИ тут девушка начинает безудержно плакать.\n- Что случилось, - встревожился парень - я тебя чем-то обидел?\n- Нет, просто ты первый...\n- Милая, неужели я у тебя первый?\n- ...Первый, кто снял меня с гвоздика...',
    'Приходит сын к отцу и говорит:\n- Отец, я хочу женится на однокласснице Маринке.\n- Понимаешь, сынок, я в юности встречался с её матерью. В общем Маринка твоя сестра.\n- Ну тогда на соседке Насте.\n- И с её матерью я встречался. Настя моя дочь.\n- Тогда на Марте из соседнего дома.\n- И с её мамой у меня было.\nГрустный сын пошел к маме, а она спрашивает его:\n- Почему ты такой печальный?\n- Да вот жениться не могу ни на Маринке ни на Насте, ни на Марте. Отец сказал, что они мои сестры.\n- Ой, сынок, женись на ком хочешь, это не твой отец.',
    'Лепщица пельменей с 25-летним стажем, потрепав сына за щеку, машинально завернула ему ебальник вовнутрь',
    'Идёт мужик, идёт, идёт, вдруг, встречает он желтую хуйню\n— Ты кто такой нахуй?\n— Я желтое уёбище\nПошёл мужик дальше. Встретил он синюю хуйню\n— А ты ещё нахуй кто?\n— Я синее уёбище\nПошёл мужик дальше, почёсывая затылок и встречает чёрную хуйню\n—  А ты, видимо, чёрное уёбище!\n\nВот так и забанили мужика на твиче',
    'Интревью с Бондарчуком:\n-Скажите, Федор,как Вам фильм "Пираты карибского моря 4"?\n- Это замечательный фильм! Отличная режиссерская работа! Я снимаю шляпу!\n- Федор, мы знаем, что Вы снимаете! Расскажите, как Вам фильм?',
    '- Кто там?\n(тишина в ответ)\n"Немые" - догадался Штирлиц.',
    'Поручик прогуливается по захваченной деревне и вдруг за стеной одного дощатого сарая слышит какое-то странное журчание. \nРостов прислушавшись: \n-Кто там ссыт как полковая лошадь!? \nВ ответ тишина. \nРостов после некоторой паузы и громче: \n-Кто там ссыт как полковая лошадь!!? \nОпять тишина за стеной. \nРостов уже орёт: \n-Я спрашиваю: кот там ссыт как полковая лошадь!!!1!? \nПо-прежнему нет ответа. \nТам стояла полковая лошадь.',
    'Клуб зануд \n \n–Здраствуй, теперь ты у нас новенький. Возьми себе тут стул. \n \n–Ну, технически, это табуретка. \n \n–Похоже, у нас новый председатель',
    'Идут панк и анимешник по улице. Видят — в мусорном баке бабка застряла. Ну панк спустил штаны, пристроился и начал еë ебать. Кончил, хер об спину бабки вытер и поворачивается к анимешнику:\n— Теперь твоя очередь! \nАнимешник залазит в мусорный бак и снимает штаны.',
    'Заходит в бар прокажённый. Весь в язвах, гное, всё сочится.\n\nСадится за стойку и вежливо просит бармена:\n\n- Мне пиво, пожалуйста. Но если вас мой вид смущает, или вам неприятно...\n\nБармен его перебивает:\n\n- Да расслабься, чувак, бывает.\n\nНо через три минуты бармен глянул в его сторону и чуть не сблевал.\n\nПрокажённый говорит:\n\n- Давайте я уйду, я же вижу - вам неприятно.\n\nБармен:\n\n- Не-не, чувак, сиди! Дело не в тебе!\n\nЕщё через минуту бармена опять чудом не выворачивает наизнанку.\n\nПрокажённый снова:\n\n- Я же говорю, что мне лучше уйти...\n\nБармен:\n\n- Сиди, чувак! Я же ясно сказал - дело не в тебе! Дело в твоём соседе. Он чипсы в твою руку макает',
    'Стоят на Ричмондском мосту в Лондоне два человека и усиленно спорят...\n— Билл, если ты такой великий оратор, как говоришь, то сможешь убедить любого человека прыгнуть вниз, к примеру того...\n— Да, Джон, смогу... смотри, — подходит к человеку:\n— Я вижу вы англичанин...\n— Да...\n— У меня для вас плохая новость, на Англию напали ирландцы, захватили в плен королевскую семью и диктуют свои условия.\n— О ужас! Мне незачем жить! — закричал он и прыгнул с моста.\n— Билл, это могло быть простой случайностью! Заставь прыгнуть еще одного.\nТот подошел еще к одному:\n— Я вижу, вы француз?..\n— Да...\n— У меня для вас плохая новость — ваша жена уехала с вашим другом на вашей машине и забрала вашу кредитную карточку!\nТот со словами «Мне не на что жить» прыгает с моста.\nДжон:\n— Ну если ты заставишь спрыгнуть еще одного, я точно поверю.\nБилл подошел еще к одному.\n— Я вижу, вы хохол?\n— Да.\n—Кто не прыгнул- тот москаль',
    'Очень грустный человек заходит в бар и заказывает виски. \nБармен спрашивает у него, мол, что произошло? \nГрустный человек отвечает: \n— Моя жена изменяет мне с другим и я ничего не смог с этим сделать. Поэтому я собираюсь напиться в этом баре до смерти. \nБармен говорит: \n— Сэр, извините, но я не буду помогать вам совершать самоубийство никаким образом, и, следовательно, виски вам не продам. \nЧеловек спрашивает: \n— А что бы вы сделали, если бы ваша жена вам бы изменила с другим человеком? \nБармен говорит: \n— Да я бы просто убил этого парня! \nГрустный человек внезапно широко улыбается и выбегает из бара. \nЧерез час он довольный возвращается в бар и садится за стойку. \nБармен спрашивает: \n— Так ты что, все-таки убил того парня? \nЧеловек отвечает: \n— Нет, я только что переспал с твоей женой. А теперь виски, пожалуйста',
    'Приходит татарин в публичный дом, и предлагает проституткам секс "по-татарски". Все подумали, что он изврат какой-то, прогнали его. А одна старая проститутка удивилась. "Все позы знаю, все виды. А тут по-татарски!". \n \nПрошли они в комнату, потом татарин довольный выходит, а за ним проститутка. \n \nПодходит она к коллегам, все спрашивают: Ну как это? \n \nСтарая проститутка говорит: да ничего необычного. Чай попили, потрахались. Только вот деньги обещал завтра занести',
    'Штирлиц почувствовал спиной, что приближается смертоносный свинец. Он успел отпрыгнуть, смертоносный свинец со свистом и хрюканьем промчался мимо.',
    '— Что вы можете сказать о героине романа?\n— Роман честный наркодилер, и героин у него что надо.',
    'Дикий запад. Сидит мужик в салуне. \n \nК нему подходит ковбой-амбал и начинает докапываться, разгорается перепалка и ковбой орёт: \n \n- Я СЕЙЧАС УБЬЮ ТЕБЯ! \n \n- Ну, всё - думает мужик - пиздец! \n- Нет - говорит внутренний голос - это ещё не пиздец, доставай револьвер, стреляй в ковбоя и в окно! \n- А чё бы и нет? \n \nМужик достаёт револьвер, стреляет и в окно. Друзья ковбоя выбегают из салуна с оружием и бегут к мужику. \n \n- Ну, всё - думает мужик - пиздец! \n- Нет - говорит внутренний голос - это ещё не пиздец, у тебя быстрый конь и много патронов! \n- И правда. \n \nМужик садится на коня и даёт дёру, отстреливаясь. Заезжает в лес. Видит - за ним увязался индейский отрядец. \n \n- Ну, всё - думает мужик - пиздец! \n- Нет - говорит внутренний голос - это ещё не пиздец, скачи во весь опор по направлению к горам. \n \nПоскакал. Индейцы сбили отравленными стрелами коня, окружили. \n \n- Ну, всё - думает мужик - пиздец! \n- Нет - говорит внутренний голос - это ещё не пиздец, ты ещё можешь убить вождя. \n \nПодходит вождь к мужику, мужик достаёт старый кольт и стреляет вождю прямо в голову. \n \n- Ну вот - говорит внутренний голос - теперь точно пиздец!',
    'Заходит впервые на зону молодой парень, на днях 19 стукнуло. Зашёл, значит, в хату, а там десять здоровенных зеков сидит. Парень сразу вспоминает слова брата: «На зоне надо быть дерзким, так сказать свои правила на хате писать». И тут этот пацан как заорёт:\n-ВСТАЛИ ВСЕ!!!\nЗеки как подорвались с коек по стойке смирно, так и стоят между собой переговаривал мол, блатной наверное...\nА один остался сидеть на койке, сидит да хрипит.\nА парень говорит:\n-ТЫ ЧЕ СИДИШЬ?\nНу зек не растерялся и говорит:\n-А я петух.\n\n-ТЕПЕРЬ Я ТУТ ПЕТУХ!!!',
    'Нашел парень себе девушку. Через время у них завязался диалог:\n— Милая, а кто у тебя был до меня?\n— Ты у меня как Юрий Гагарин.\n— В смысле первый?\n— Да, если не считать нескольких собак.',
    'У студентов из Петербурга даже досуг по расписанию.\nСначала инста – потом грамм.',
    'Лошадь сидит дома, смотрит MTV. Выступает группа, играющая хэви-метал, и гитарист играет удивительное соло. \nЛошадь говорит "это потрясающе, я тоже хочу научиться этому!" \nЛошадь ищет учителя музыки, звонит ему и спрашивает: \n"Привет, я хотела бы научиться играть на гитаре" \n"Конечно," — отвечает человек по телефону. — "Просто приходи к нам на урок, чтобы начать занятия" \n"Есть одна проблема," говорит лошадь. "Я лошадь." \n"Не волнуйтесь," говорит человек. "У нас есть новые современные технологии, чтобы учить лошадей. Вы будете играть как профессионал" \nЛошадь и учитель, используя современные технологии, несколько лет, не покладая гитару, занимаются и, наконец, лошадь начинает играть соло. \nОна хочет показать это своим друзьям, поэтому звонит другу-курице. \n"Эй, Цыпленок, приходи ко мне". \nЦыпленок приходит, смотрит, как лошадь играет на гитаре и думает, что это очень здорово. \nПотом они смотрят то самое музыкальное видео, и цыпленок говорит: \n"А ведь и на барабанах здорово стучат. Я хочу научиться также играть" \nЦыплёнок ищет учителя музыки, звонит ему и спрашивает: \n"Привет, я хотел бы научиться играть на гитаре" \n"Конечно," — отвечает человек по телефону. — "Просто приходи к нам на урок, чтобы начать занятия" \n"Есть одна проблема," говорит цыпленок. "Я курица" \n"Не волнуйтесь," говорит человек. "У нас есть новые современные технологии, чтобы учить куриц. Вы будете играть как профессионал" \nКурица и учитель, используя современные технологии, несколько лет, не вылезая из-за барабанной установки, занимаются и, наконец, цыпленок начинает лихо стучать на барабанах. \nЦыпленок начинает рубить хэви-металл с лошадью. \nВ конце концов, они думают, что чего-то не хватает. \nОни смотрят видео снова и понимают, что им нужен бас-гитарист. \nОни вызывают их друга Корову и показать ей класс. \nКорова думает, что это очень здорово, и хочет научиться играть на бас-гитаре. \nКорова ищет учителя музыки, звонит ему и спрашивает: \n"Привет, я хотела бы научиться играть на бас-гитаре" \n"Конечно," — отвечает человек по телефону. — "Просто приходите к нам на урок, чтобы начать занятия" \n"Есть одна проблема," говорит лошадь. "Я корова" \n"Не волнуйтесь," говорит человек. "У нас есть новые современные технологии, чтобы учить коров. Вы будете играть как профессионал" \nКорова и учитель, используя современные технологии, несколько лет, не покладая гитару, занимаются и, наконец, корова начинает играть на бас-гитаре. \nОни начинают играть в общественных местах и однажды их слышит продюсер. \nОн идет к животным и говорит: "Эй, вы, ребята, вы классно играете! Я хотел бы заключить с вами контракт!" \nГруппа записывает альбом, выпускает несколько синглов и становится популярной. \nОни едут в мировое турне и зарабатывают кучу денег. \nИ прямо перед финальным шоу тура, который должен состояться в Лас-Вегасе, лошади звонят и сообщают, что её мать находится в больнице. \nЛошадь едет к ней, чтобы увидеть ее до начала шоу, в то время как остальная часть группы летит в Лас-Вегас готовиться, настраивать оборудование. \nНо когда лошадь выходит из больницы, ей снова звонят. \nЧастный самолет, который перевозил группу и их продюсер упали в океан и никто не выжил. \nЛошадь опустошена. \nВсе её лучшие друзья мертвы, она потеряла работу, мама при смерти. \nНа глазах у неё слезы, и она решает упиться до смерти. \nОна заходит в бар, присаживается к стойке, подбегает бармен и говорит: \n"Мы лошадей не обслуживаем"',
    'В семье консерваторов случилось горе....\n.\n.\n.\n.\n.\n.\n.\n.\nБанка лопнула.',
    'Греки придумали математику, чтобы Европа могла вычислить их долг.',
    'Взволнованные родители слепой девочки приводят ее к частному психологу...\n\n- Понимаете, доктор... Дело в том, что наша дочь слепая от рождения... И, видимо, на этой почве у нее комплекс... Она постоянно чувствует себя обделенной, ей кажется, что мы ей недостаточно уделяем времени, мало играем... Когда садимся за стол обедать или ужинать, то она думает, что в наших тарелках больше еды, что и в этом мы ее ущемляем... Что делать? Подскажите...\n\n- А какое у нее любимое блюдо?\n\n- Пельмени оч-ч-чень любит!!!\n\n- Так придите сегодня домой да и наварите ей целое ведро!\n\nПришли домой родители, так и сделали... Дочка за ужином, уплетая пельмени:\n\n- О-о-о-о!!!... Суки!!! Сколько же тогда себе положили???',
    'Стоят два наркомана на перроне, мимо проезжает поезд и из окна вылетает прокладка, и прилепляется прямо на лицо одному из них. Сдирает он прокладку с лица, мнёт в руках и говорит:\n-Хуясе такая мягкая, а ебало в кровь разбила',
    'Дагестанские врачи клянутся мамой Гиппократа',
    'Армянин решил баллотироваться в рейхстаг. У Гиммлера: \n- Род деятельности? \n- Машинист \n- Возраст? \n- 35 лет \n- Национальность? \n- Армянин \n- Характер? \n- Нардический',
    '-Угадай в какой руке?\n-В левой.\n-Черт.\nОднорукий Джо не умел делать сюрпризы.',
    'Едет поезд <img alt="🚂" class="emoji" src="/emoji/e/f09f9a82.png"/><img alt="🚋" class="emoji" src="/emoji/e/f09f9a8b.png"/><img alt="🚃" class="emoji" src="/emoji/e/f09f9a83.png"/><img alt="🚋" class="emoji" src="/emoji/e/f09f9a8b.png"/><img alt="🚃" class="emoji" src="/emoji/e/f09f9a83.png"/><img alt="🚋" class="emoji" src="/emoji/e/f09f9a8b.png"/> в Херсон. Все пассажиры уже расположились, тишь да уют. Как неожиданно, поезд слетает с рельс и в кювет, проносится по насыпи, врезается в деревянную баню у дороги и падает в реку. Переплывает реку, и ныряет на полном ходу в кукурузное поле. Делает на нём пару петель, затем выныривает из кукурузы на сельскую дорогу, а по ней возвращается опять на рельсы и продолжает ход. В вагонах паника, всë разбросано, посуда разбита, шум и гам. Люди толпой вбегают к машинисту и кричат: "Что случилось?! " Машинист им и отвечает: \n-Еду спокойно, никого не трогаю. Как вижу, сидит мужик на путях и срёт. Оттого всë и случилось. \n-Так зачем вы так? Надо было давить эту паскуду, и дело с концом! \n-Так я его в кукурузном поле только и догнал, - ответил мудрый машинист, остановил поезд и пошёл срать на путях.',
    'Захотел мужик купить собаку. Купил газету объявлений, просматривает ее, вдруг видит объявление — "Продается говорящая собака!". Не поверил, звонит: \n— У вас продается говорящая собака? \n— Да \n— Действительно, говорящая!? \n— Ну да, приезжайте, сами посмотрите! \nИ называют ему адрес — окраина города. Промышленный район. \nНу тот приезжает по адресу, смотрит, а дом — убитая старая хрущовка. Заплесневелые стены в подъезде истыканы бычками, грязно, нассано. Лампы не горят. \nПодходит к обшарпаной двери, звонок выломан — приходится стучать. дверь открывает мужик в линялой тельняшке, в растянутых на коленях трениках и в тапках с дырявым носом. \n— Здравствуйте, у вас собака продается говорящая? \n— Ну да да, проходите, пожалуйста, я думал вы немного позже подъедете, у меня тут дела на кухне срочные, подождите пока в коридоре, я быстро все закончу и подойду. А вот и собака сидит, знакомьтесь. \nИ уходит на кухню. Мужик смотрит, сидит в проходе тощая дворняга и говорит: \n— Ну давайте, чтобы время не тратить, я вам пока немного расскажу о себе: \nВ начале восьмидесятых ученые проводили эксперименты с селекцией у собак и им удалось вывести два помета, собаки в которых умели разговаривать. Один помет обучили русскому языку, второй обучили и русскому и немецкому языкам. Я оказалась в помете, обученной русскому и немецкому. Ну потом по распределению поехала работать в посольстве в ФРГ, слушала разговоры и передавала начальству, потом перестройка, Горбачев, гласность вот это все... В общем оказалась я на стройке сторожем, а потом здесь. \nТут хозяин возвращается с кухни, спрашивает: \n— Ну что, познакомились? Покупать будете? \n— Конечно! За сколько продаете? \n— Да сколько не жалко, в принципе... \n— Но как?! Это же говорящая собака! Ей цены нет! \nХозяин отвечает: \n— Да пиздит она про посольство и вот это всё',
    'Приходят люди на концерт System Of A Down, а там армяне на гитарах играют',
    'Один человек спросил у Сократа: \n— Знаешь, что мне сказал о тебе твой друг? \n— Подожди, — остановил его Сократ, — просей сначала то, что собираешься сказать, через три сита. \n— Он сказал, что ты пидор! \n— Прежде чем что–нибудь говорить, нужно это трижды просеять. Сначала через сито правды. \n— Что ты несёшь? Так ты пидор? \n— Значит, ты не знаешь, это правда или нет. Тогда просеем через второе сито — сито доброты. Ты хочешь сказать о моем друге что–то хорошее? \n—Бля.. ты даже разговариваешь как пидор! \n— Значит, ты собираешься сказать обо мне что–то плохое, но даже не уверен в том, что это правда. Третье сито — сито пользы. Необходимо мне услышать то, что ты хочешь рассказать? \n— Хмм… нет. \n—Пидора ответ! — заключил Сократ.',
    'Внук подошел к деду перед Днем Победы и спросил:\n— Деда, а ты в какой части служил?\n— В 152-й артиллерийской дивизии, внучек!\n— А где вы воевали?\n— Сначала защищали Ленинград, потом в атаку - через Финляндию немцев погнали!\n— Дед, но ведь 152 дивизия сражалась под Москвой...\n— Ой, внучек, может я попутал цифру, старый уже\n— Дед, а как ты ранение получил?\n— Ну я на вражеский дзот лег грудью\n— А почему у тебя тогда шрам от пули на спине?\n— Ой, да я может что и попутал, старый уже\n— Дед, а сколько лет тебе было, когда ты воевал?\n— 20\n— Тебе сейчас 60, как так вышло?\n— Как вышло - как вышло, пошел нахуй, сука!',
    '- Дедушка, а чем ты в молодост занимался?\n\n- Дурак твой дед...',
    'Цыгане украли моего отца. Золотой был человек!',
    'Молодой парень приходит к старому мастеру кунг-фу: "Мастер, я много наслышан о вас. Не могли бы вы научить меня вашему искусству?" \nМастер, лениво подняв бровь, бросил в ответ: "Ты ещё зелен и недостоин обучаться моим техникам".\nНа что новичок отвечает следующее:\n-Но великий мастер! Есть в этом мире хоть что-то, что поможет мне созреть и обучаться у вас?\n-Хмм... Пожалуй, есть. Настоящий ученик даже в самом начале пути должен превзойти своего мастера. Должен быть уверен в себе. Крепок, как скала. Тебе нужно победить меня в поединке.\n-Но мастер, ведь я совсем не умею драться, как я могу вас победить?\n-Ты должен верить!\nГлубоко вдохнув, ученик согласился и встал напротив мастера.\nМастер кунг-фу дал ему пизды.',
    'Идёт международный конкурс медвежатников. Задача — за пять минут вскрыть мегазащищённый сейф с миллионом долларов внутри. Кто сможет — тот забирает деньги. \nВыходят американцы, жюри тушит свет, включает. Американцы справились с электронным замком, не вскрыли механический. \nВыходят итальянцы. Тушат свет, включают — те вскрыли механический, застряли на электронном. \nВыходят два джентльмена из Одессы. Жюри тушит свет, через пять минут свет включают… а он не включается. \nИз темноты доносится голос с характерным акцентом: «Изя! Ми только что взяли миллион долларов. ЗАЧЕМ ТЕБЕ ИХ ЛАМПОЧКИ?!»',
    'Ползёт солдат в окопе, встречает другого солдата.\n- Куда ползешь?\n- Медсестру ебать.\n- А она даст?\n- Даст.\n- А в пизду даст?\n- Даст.\nПолзут вдвоём.\nВстречают третьего солдата.\n- Вы куда ползёте?\n- Медсестру ебать.\n- А она даст?\n- Даст.\n- А в жопу даст?\n- Даст.\nПолзут втроём.\nВстречают четвёртого солдата.\n- Вы куда втроём ползёте?\n- Медсестру ебать.\n- А она даст?\n- Даст.\n- А в рот даст?\n- Нет, не даст.\n- Почему же?\n- Так ей же голову оторвало.',
    'За каждым великим мужчиной, стоит женщина, стоит и пиздит',
    'Обед в еврейской семье. Мама дала кусок торта.\n- Мама, а я хочу два!\n- Моня, таки возьми нож, разреж кусок на два и не еб* мне мозги!',
    'Мамаша приводит свою 15-летнюю дочь к врачу:\n– Доктор, мою дочь постоянно тошнит.\nВрач осмотрел девицу и говорит:\n– Ваша дочь беременна, на пятом месяце...\n– Да вы что, доктор, моя дочь-паинька, она никогда не была с мужчиной. Правда, дочка?!\n– Даже не целовалась ни разу! – говорит дочь.\n– У меня огромный опыт в этом деле, и я уверенно заявляю, что ваша дочь - беременна. \n– Да нет же, не может этого быть!\n– Да я её лично ебал!',
    'В дверь не стучали. \n"Я вообще никому не нужен" — грустно подумал Штирлиц и выстрелил себе в голову',
    'Идут по пустыне 100 негров. Встретили джина. Первый, умный, негр загадал желание, чтобы все стали белыми. Второй негр, приколист - чтобы все стали черными. Третий - опять белыми. Четвертый - черными. \nЛетит над пустыней израильский F-16. Пилот: "Че за херня там мигает? Надо ракетой ебануть".',
    'Еврей, индус и негр остановились в крохотной гостинице. Там оставался только один свободный номер с двумя кроватями. Кто-то третий должен был идти ночевать в сарай на соломе. Первым вызвался еврей: «Я воспитывался в кибуце в Израиле и легко переночую в сарае»,— сказал он и ушел. Но через 15 минут в дверь постучали — это вернулся еврей. «В сарае я обнаружил свинью, я не могу спать с нечистой свиньей под одной крышей» Тогда выступил индус: «Нет проблем, я вырос в Бомбее и я совершенно спокойно переночую в чистом сарае со свиньей». Но и он постучал в номер через 15 минут, потому что обнаружил в сарае корову, которая для индусов священна. Он не мог спать с ней под одной крышей. Наконец поднялся негр. Он заявил, что вырос в южном Лос-Анджелесе и никакие свинья и корова не помешают ему провести прекрасную ночь в сарае. Через 15 минут в дверь номера постучали. На пороге стояли свинья и корова.',
    'Едет чукча в такси. Вдруг дорогу перебегает старушка. Водитель вправо - старушка вправо. Водитель влево - старушка влево. Кое-как водитель уклонился, оборачивается назад - лежит старушка на дороге. Чукча говорит: - Белый охотник - плохой охотник. Если б чукча дверцу не открыл, ушел бы бабка.',
    'Анекдот категории "Б" похож на изысканное вино, в которое только что насрали.',
    'Админ АКБ+ приобрел в Африке большой анекдот, величиной с Бугурты как на Двачах. Но внутри анекдота был пробел. Шутняра, которому владелец анекдота показал мне чудо, восхищённо покачал головой, и сказал:\n– Этот анекдот можно расколоть на две части, из которых получатся две великолепных шутки, каждый из которых будет во много раз дороже анекдота про Армян и Нарды. Но неосторожный удар может разбить это чудо природы на горсть говнистых анекдотов, которые будут хуже бородатых анекдотов. Я не берусь так рисковать...\nТак же отзывались и другие. Но однажды ему посоветовали обратиться к старому шутняре Бэбэю из Урожайска, мастеру с золотыми руками. Тот рассмотрел анекдот и снова рассказал о рисках. Админ сказал, что эту историю он уже знает наизусть. Тогда шутняра Бэбэй согласился помочь, назвав хорошую цену за работу.\nКогда админ согласился, шутняра вызвал своего молодого подмастерье. Паренек положил анекдот на ладонь и один раз ударил по анекдоту молоточком, разбив его на кучу форсов с Деградача.\n-Бля- сказал Бэбэй, - Сорян',
    'Два строителя сели перекусить. Первый достаёт из пакета бутерброд с маслом. "Блять, с маслом" - говорит он и выбрасывает бутерброд. Достаёт следующий. Этот снова с маслом. "Да блять!" - кричит рабочий и выбрасывает бутерброд. Достаёт третий бутерброд. На этот раз бутерброд с колбасой. Строитель с удовольствием его съедает. Он достаёт четвёртый бутерброд. "Да сука, опять с маслом!" - выбрасывает и его. Тогда второй рабочий спрашивает: "Ты женат?"\n"Женат", - отвечает первый строитель.\n"Сколько лет?"\n"Десять"\n"И твоя жена за десять лет так и не поняла какие бутерброды ты любишь?"\n"Блять, отъебись от моей жены!" - заорал первый строитель - "Я сам эти ёбаные бутерброды делал!"',
    'У мужика вздулся живот. Он к врачу. А врач решил приколоться и говорит: "Э, да ты беременный". Мужик в панике: "Дайте самое сильное средство чтобы был выкидыш". Врач даёт ему слабительное. Пей, говорит, по одной таблетке в день. Ну мужик сразу горсть и выпил. Идёт на измене по улице и тут прихватило, ну всё думает, рожаю. Оглядывается и видит открытый канализационный люк, присел над ним и сделал сброс. А в люке сантехник, орет: "Ой, мамочка" и пытается вылезти весь в говне. У мужика вообще крышу снесло, толкает его ногой обратно в люк и орет: "Нет у тебя мамы. Сирота ты, сирота!!!!!"',
    'Пригласила девушка парня "винду переустановить". Но парень оказался не простым и действительно начал ставить ПО.\nТогда девушка сказала прямо: "хочу трахаться". Парень пронзительно на неё посмотрел и со словами "Ааа... Что ты сразу то не сказала?" поставил линукс',
    'Получили дед и бабка от Вовочки письмо, дед читает: "Здравствуйте, дедушка и\nбабушка! Сегодня я первый раз пошел в школу и у нас был урок правды, учительница\nговорила нам, что нужно все время говорить правду. Ну так вот, я решил сказать\nвам правду: прошлым летом когда я у вас был, я залез в погреб и съел\nбанку малинового варенья, потом насрал туда и поставил на место." Тут дед бабке\nкак ударил в лоб:\n- Я говорил тебе - говно, а ты - засахарилось, засахарилось...',
    'Строй новобранцев перед ними прапор:\n- Иванов\n- Я\n- Кем был до армии?\n- Каменьщиком\n- Отлично, Иванов! Будешь строить казармы\n- Сидоров\n- Я\n- Кем был до армии?\n- Моляром\n- Отлично, Сидоров! Будешь красить казармы\n- Петров\n- Я\n- Кем был до армми?\n- Клюкальщиком\n- Кем кем?\n- Клюкальщаком\n- Это кто такой?\n- Ну это тот кто клюкало делает?\n- А что это такое за клюкало?\n- Ну как вам объяснить? Дайте мне военную мастерскую на 3 дня в\nраспоряжение, я вам такое клюкало сделаю!!!\n- Петров, ты что ох..л??? На 3 дня? Мы в график и так не\nукладываемся!!! Ну черт с тобой уж очень на клюкало посмотреть хочется.\n\nПроходит 3 дня, все это время из мастерской валит дым слышиться скрежет,\nкороче работа кипит. Выходит Петров с листом искареженного\nпродырявленного железа.\n- Петров???!!! Это что за ху..я??? НА ГУБУ!!! НА МЕСЯЦ!!! НЕТ ДО КОНЦА\nСЛУЖБЫ БУДЕШЬ СОРТИРЫ ДРАИТЬ!!!!\nВобщем Петров на губе, а клюкало к прапору в кабинет бросили.\nПриезжает проверка, генерало все не нравится: бараки кривые, покрашенны\nхреново и т. д. Короче прапору разгон устраивает в кабинете\n- А что это у вас такое отличное клюкало тут делает\nПрапор в шоке:\n- Выбросили, товарищ генерал\n- Вы тут что совсем все еб..ись?? Кто сделал?\n- Петров, товарищ генерал\n- А где Петров?\n- На губе\n- Нет ну точно еб...сь!!!!! Петрова сюда!\nПриводят Петрова\n- Ты такое клюкало сделал?\n- Так точно, товарищ генерал\n- И сколько времени ушло?\n- 3 дня\n- Вот это да! у меня на такое месяц уходит!! Пойдем запустим??\n- Давайте товарищ генерал\nЗаплываают на лодке на середину озера.\n- Петров, а можно я?\n- Конечно, товарищ генерал!!!\nГенерал бросает клюкало в вводу, оно уходит с характерным звуком клюк,\nклюк, клюк-Ох как пошло то, как пошло!!!!!',
    'Мужик загадывает желание на новый год: чтобы всю жизнь член рос. Короче, живет – не нарадуется. Жизнь бьет ключом, от баб отбоя нет. Раз в год делает пластическую операцию (укорачивает). Прожил он свое и умер. Родственники поплакали, похоронили. Через год из могилы вылазит член. Ну неудобно как-то – срам из земли торчит – подрезали, а он через время опять… В общем родственники заебались подрезать и перезахоронили чела хуем вниз. Проходит пять лет, на Манхэттене трескается асфальт и оттуда вылазит хуй! Его срезают, а он опять растет. Мэрия в шоке, объявляет тендер на избавление от напасти. Тендер выиграли хачи, поставив на этом месте палатку с шаурмой и шашлыком…',
    '-Мюллер, какой пароль от вашего сейфа?\n-1674332220\n-А почему?',
    'Однажды дpовосек pубил деpево над pечкой и уpонил в нее топоp. Он заплакал от гоpя, но тут ему явился Господь и спpосил: \n- Что ты плачешь? \n- Как же мне не плакать, ведь я уpонил в pечку топоp и не смогу больше заpабатывать на пpопитание моей семье.Тогда Господь достал из pечки золотой топоp и спpосил: \n- Это твой топоp? \n- Hет, это не мой топоp, - ответил дpовосек. \nГосподь достал из pечки сеpебpяный топоp и спpосил: \n- Может, это твой топоp? \n- Hет, и это не мой топоp, - отвечал дpовосек. \nHаконец, Господь достал из pечки железный топоp. \n \n- Да, это мой топоp, - обpадовался дpовосек. \n- Я вижу, ты честный человек и соблюдаешь мои заповеди, - сказал Господь, -возьми же себе в нагpаду все тpи топоpа. \nСтал дpовосек жить-поживать в достатке, но тут к несчастью в pечку упала его жена. Он снова гоpько заплакал. И снова ему явился Господь и спpосил: \n- Что ты плачешь? \n- Как же мне не плакать, ведь в pечку упала моя жена. \nТогда Господь достал из pечки Дженифеp Лопез и спросил: \n- Это твоя жена? \n- нет, это не моя жена, - ответил дровосек \nТогда Господь достал из речки труп утонувшей жены и спросил:\n- Это твоя жена ?\n- Да, это моя жена- обрадовано ответил дровосек и снял с неё ведро раков',
    'Кавказская притча\n\nДиалог отца и сына:\n– Сын, у тебя есть лучший друг? \n– Есть. \n– Давай я докажу тебе, что у тебя нету лучшего друга.\n– Давай.\n– Иди в поле, зарежь барашка, кинь в мешок, и прийди к другу в 4 часа утра и скажи "я зарезал человека, пошли со мной хоронить?"\nСын все так и сделал\nНа что ему ответил друг:\n– Прости, но мне надо с девушкой погулять.\nПриходит папа и говорит:\n– Ну что, как твой друг отреагировал?\n– Не знаю, сказал что с девушкой.\n– Теперь пошли со мной:\nОтец режет барашка, кидает в мешок, идет отец к своему другу в 4 часа утра и говорит:\n– Брат, я зарезал человека, что делать?\nТот отвечает:\n–Не ты убил, мы убили!\nИ выебал барана',
    'Прыгает девочка на скакалке, рядом на лавочку подсаживается дедок. Девочка:\n— Дедуль, скажи раз…\nДед:\n— Раз…\n— Ты, дед, пидаpас!\nДед сидит офигевший. Проходит минута:\n— Дед, скажи пять!\n— Пять…\n— Пидаpас опять!!\nДед начинает злится… Еще через некоторое время:\n— Дед, скажи семь!\n— Ну семь…\n— Дед пидарас ты совсем!!!\nДед теряет терпение…\n— Да не пидарас я, меня тогда расстреляли!!!',
    'Лежит грузин на пляже, загорает. Мимо летит муха:\n-ззззззззззззззззззззззззззз, ззззззззззззззззззз.\nГрузин ее прогоняет :- Киш, киш, муха, не мешай!\nМуха не улетает:\n-ззззззззззззззззззззззззззз, зззззззззззззззззззз.\nГрузин снова:- Киш, киш, муха, не мешай!\nЗалетела муха грузину в плавки: -зззз,зззз, зззз, зззз.\nГрузин: - И тут вы не поверите товарищ майор. Муха превращается в 12 летнего мальчика.',
    'Едет мужик на машине и вдруг глохнет. Открывает капот - ничего понять не может. Вдруг из кустов высовывается лошадь и говорит мужику: \n- Ты ремень генератора посмотри! \nМужик посмотрел, и в правду ремень. Смотрит на лошадь, та ему: \n- Сними галстук и вместо ремня сделай, так доедешь до мастерской. \nМужик всё сделал, как сказала лошадь. Доезжает до сервиса, выходит весь в шоке. Мастер спрашивает: \n- Что, мужик, лошадь? \n- Ага... \n- Поди про ремень генератора что-то втирала? \n- Ага! \n- А как ты услышал, ты же глухой? \n- В смысле? \n- В начало анека гляди',
    'Мой дед говорил так- когда одна дверь закрывается, другая открывается. Хороший был дед, а вот шкафы плохо собирал.',
    'В школе учительница дает задание детям:\n- Дети, давайте пофантазируем, что получится, если скрестить двух животных разных видов.\nТянет Машенька руку:\n- Если скрестить корову и свинью, то получится сытное молоко и вкусное мясо.\nУчительница хвалит ее и вызывает Катеньку:\n- Если скрестить кролика с курицей, то получится мех и яйцо.\nТут руку тянет Вовочка:\n- Если скрестить жабу с гадюкой... Ой, нет, гадюку и ежа, то получится моча и говно. Ой, стойте, не то... Если скрестить кукушку и слона, то он будет бегать по лесу и гадить памятникам на головы. Нет-нет, во, вспомнил! Если скрестить человека, медведя и свинью, то он сел в машину... Погодите, сейчас... ученые скрестили попугая и скунса, но вместе пока не живут. А-арбуз скрестили с тараканом, теперь семечки получают за лупу. Нет, как же там... Персик с дыней это дилижанс или дифичент? Жирафа скрестили с холодильником... Бока с пико... жока и лупа... однажды Божиею поспешествующею милостию боцман... юнга, старый морской Жданов-Садюк.. я, говорит, близко к жопе беру и умер..еврей..шляпа как раз..сидит и дрочит. АААА БЛЯТЬ ТАА-ШАА...но естьодинкаламбур Ехидна большая...рукатряслась...почемфарыблять..Тиранда..анимешник...ОНИУШЛИ...дурактвойдед..threehundredbuks..грузин..сосать..есжи.айфакьюбулщит..яре-яре..\n\nУчительница вызвала скорую. Врачи диагностировали первый в мире клинический случай синдрома АКБ+',
    'Приходит мужик в зоомагазин, спрашивает продавца:\n-У тебя есть что-нибудь эдакое, необычное?\n-Ну есть кое-что - говорящая многоножка!\nМужик отнесся скептически но все же взял многоножку домой. \nДома ставит баночку с многоножкой смотрит на нее, а она молчит. Ну мужик давай проверять:\n-Я пиво пошел пить. Погнали со мной?\nВ ответ тишина. Мужик руками развел и пошел в пивнуху.\nНа следующий день возвращается думает "может вчера она стеснялась новый дом все таки". Спрашивает ещё раз:\n-Я пиво пошел пить. Погнали со мной?\nТишина. Наебали. Ну, делать нечего  мужик пошел опять в пивнуху.\nНа следующий день подходит к многоножке, думает "ну попробую последний раз и верну в зоомагазин". \n-Я пиво пошел пить. Погнали со мной?\n-Да блять я тебя в первый раз услышал, обуваюсь',
    'Просит сын у отца красивые блестящие как зеркало лакированные туфли. Упрашивал часа три. Наконец он ему разрешил.  Одел он туфли пошёл на дискотеку. Подходит к девушке в мини-юбке говорит :\n—Спорим я угадаю какого цвета у тебя трусы. \n—Ну давай. \nСмотрит парень на туфли видит отражение и говорит :\n—Красные.\n—Как ты угадал? \n—Это мой небольшой секретик. \nУходит девушка к подруге рассказывает эту историю и подруга предлагает поменяться трусами чтобы проверить наверняка. Подходит снова к этому парню и спрашивает :\n—А сейчас какого цвета? \n—Зелёного.\nДевушка в полном шоке снова приходит к подруге. Та советует ей пойти к нему без трусов, думая что это он точно не угадает. Она снимает трусы подходит к парню :\n—Давай в последний раз, угадывай. \n—Парень смотрит на отражение туфли и падает в обморок. \nДевушка подбегает к нему начинает его трясти, тот очнулся, посмотрел на туфли и сказал :\n—Блять я думал что туфли порвал.',
    'Поймал Змей Горыныч англичанина, француза и хохла. И говорит: \n— Кто расскажет мне такую историю, что все три головы скажут "Да ну нахуй" того отпущу, а если хоть одна голова скажет "Бывает", того съем! " Англичанин: \n— Один английский джентельмен купил машину, и только он выехал на ней из магазина сразу же разбил в дребезги. Две головы: — Да ну нахуй, третья: "Фигня, бывает". Съели! \nФранцуз: один французский джентльмен решил жениться, и прямо в церкви его невеста изменила ему со свидетелем. Две головы: — Да ну нахуй, третья: "Бывает". Съели! \nА хохла спросить забыли.',
    'Сидит поручик ковыряется в зубах,\nвыковыривает малиновую косточку и говорит:\n"Странно малины год не ел"\nНа что денщик ему заявляет:\n"Да вы же поручик вчера с графиней целовались."\n"Ну и что?"\n"А то что она полковнику сосала."\n"Ну и что?"\n"А он на балу рассказывал, как своего денщика в жoпу тpaxнул за то,\nчто тот банку малинового варенья сожpaл."',
    'Встретились Хой, Цой, Горшок и Морген, ну и вздумали бухнуть. Купили литруху, ну и типа говорят - мы же поэты - давайте кто сколько в стихах попросит, тому столько и нальём. \nГоршок встаёт: \n- Замученный дорогой, я выбился из сил, \nИ в доме лесника налить мне рюмку попросил! \nНалили ему рюмку. \nВстаёт Цой. \n- Группа крови - на рукаве! \nВы налейте мне рюмку! А лучше две! \nНалили ему две. \nХой встаёт: \n- Из колхозной молодёжи панковал один лишь я! \nНаливайте мне три рюмки, щас нажруся как свинья! \nНалили ему три. \nМорген встаёт: \n- ТРУ РУРУРУРУ ТУРУРУРУ ТУРУРУ ПОСОСИ У У У У У ДА Я БОГАТЫЙ УЕБОК У МЕНЯ ДЕНЕГ ТАК МНОГО МОЁ ЕБАЛО КОРОБКА У У У У У ХУЙ ОГРОМНЫЙ КАК ПЕНИС НА МНЕ ПРЫГАЕТ ЖОПА\n- Алишер, а наливать-то тебе сколько? \n- Четыре.',
    'Приходит как-то женщина к гинекологу, тот смотрит говорит:\n-ебать у вас пизда огромная, ебать у вас пизда огромная\nЖенщина спрашивает:\n-а зачем вы 2 раза сказали\nВрач отвечает:\n-это эхо',
    'Стоит армянин возле зеркала голый смотрит на себя, тут он поворачивается жопой и тут у него встал хуй, и он говорит:\n.\n.\n.\n.\n.\n.\n.\n.\n.\n-"Тихо, тихо, свои"',
    'Говорят, мужчины, которые смотрят аниме, в среднем на десять процентов умнее, чем их парни.',
