    'Один мужик в заводской столовой заказывает окрошку, а ему отвечают, что закончилась, Петрович последнюю тарелку забрал. Ну он ищет взглядом Петровича, и видит, что тот уже пообедал, но окрошка нетронутая стоит. Ну он подходит и спрашивает "Петрович, ты что, окрошку не будешь?". Петрович отвечает: "Не, угощайся". Мужик обрадовался и начал лакомиться. Выхлебал полтарелки, видит - на дне дохлая мышь лежит. Ну он мгновенно все обратно в тарелку и выблевал. Петрович на это смотрит и говорит "ну да, я тоже примерно после половины тарелки заметил".',
    'Было у Сталина два танка и он катался на них по очереди.\nОчередь возмущалась, но не расходилась.',
