    'Едет монашка с валютной проституткой в одном купе. На путане норковая шуба, изумруды в ушах, брильянтовое колье на шее. \n— Скажите, а сколько стоит ваша шуба? — робко интересуется девственница. \n— Одну ночь любви. \n— А изумрудные сережки? \n— Две ночи любви. \n— … \n— Если вы хотите спросить о колье, то мне оно досталось после недели, проведенной на Багамах с богатым лохом. \nВернулась грустная монашка к себе в монастырь, заперлась в келье. Стук в дверь. \n— Кто это? \n— Отец Георгий, пусти… \n— Шли бы вы, батюшка нах*й со своими карамельками',
