    '—Беня, я гарантирую вам, шо через пять лет мы будем жить лучше, чем в Европе! \n— А шо у них случится?',
    'Есенин, заигрывая с двумя девушками, выходит из кабака. Одна девушка, кокетливо спросила его:\n-Сергей Александрович, а правда, что вы можете любое событие представить в виде стихотворения?\n-Конечно.\n-А давайте проверим. Видите пьяного бомжа на дороге? Попробуйте что-то сочинить про него.\nЕсенин на секунду задумался, потом начал:\n-Лежит безжизненное тело\nНа нашем жизненном пути\nВдруг тело гордо поднимает голову и отвечает:\n-Тебе, мудак, какое дело?\nИди блядей своих еби!\n-Ой, девочки, пойдёмте, это Маяковский отдыхает',
    'В Шервудском лесу объявился новый разбойник по имени Ребе Гуд. Он забирает деньги у богатых и отдает бедным под процент.',
    'Командир демонстрирует солдатам атом.\n- Вот, товарищи бойцы, это суперпозиция. Петров.\n- Я!\n- Засними на камеру суперпозицию атома.\nПетров тужится, пыжится, не заснять.\n- Не заснять.\n- Сидоров, помоги Петрову.\nПытаются вдвоем, та же ситуация.\n- Не заснять.\n- Иванов, помогай.\nПыхтят втроем. Заснять не могут.\n- Никак не заснять, товарищ командир! Мы не понимаем!\n- А хули вы хотели? Квантовая физика!',
