    'Дом девочки находился между ПТУ и кладбищем, поэтому чтобы ночью не было страшно, она шла через кладбище.',
    'Первый:\n— А вот бы накупить китайских часов по дешёвке, на машине времени махнуть в прошлое лет на 30, там их загнать по высоким ценам и накупить на полученные деньги долларов по 60 копеек!\nВторой:\n— Лучше изобрести такую машину, как ксерокс, только для предметов, а потом взять кусок золота, и ксерить его, ксерить!\nТретий (главный):\n— Господа министры, ещё будут предложения по оздоровлению экономики?',
    'Собрались как-то волк, заяц и лиса в Америку ехать, решили себе псевдонимы взять.\nВолк:\n-я буду вил пип \nЗаяц:\n-я буду зил пип\n\nА лиса пошла, и умерла от передоза',
    'Джентльмен звонит с работы из Лондона домой за город, трубку берет дворецкий:\n\n-Джон, как себя чувствует моя собака?\n-Прекрасно, сэр, она только что полакомилась свежей крольчатинкой.\n-Джон, как себя чувствует мой попугай?\n-Прекрасно, сэр, он только что уснул в своей позолоченной клетке.\n-Джон, как себя чувствует моя жена?\n-Прекрасно, сэр. Ваша жена только что уединилась с вами в вашей спальне.\n-Джон, сходите, пожалуйста, в мой кабинет, возьмите ружье, с которым я хожу на охоту и убейте сначала меня, а потом мою жену.\n-Слушаю сэр.\nВскоре Джон возвращается к телефону:\n\n-Сэр, вас я убил сразу, а за вашей женой пришлось долго гоняться по ореховой гостиной.\n-Джон, но у нас нет ореховой гостиной.\n-Куда вы звоните, сэр?',
    'Стоит солдат с автоматом , охраняет ангар. \nПодходит мужик и говорит: \n— Продай автомат. \nСолдат ему в ответ: \n— Да не,не могу - я тут ангар с двумя секретными самолётами охраняю. \nМужик снова: \n— Продай,не улетят твои истребители. \nСолдат упирается,не хочет никак продавать автомат. \n— Вдруг что-нибудь начнется,а я тут без автомата! \nМужик уговаривает: \n— А если начнётся - ты палку подбери какую-нибудь и бегай с ней,стреляй,типа.Никто и не заметит. \n— Ну даже не знаю...Ладно продаю. \nПродал мужик автомат. Через неделю началась война,солдат бегает покруг ангаров и кричит: \n— пуф - пуф, тррр! \nОткрывается ангар и оттуда выбегают два лейтенанта: \n— ВЖЖЖЖЖЖЖЖЖЖ..',
    'мужик идёт по Москве и видит большую очередь в какой-то домик. интересно стало, подходит и спрашивает: \n— что за очередь? \n—в комнату смеха. кто ни выходит оттуда, все смеются, видишь? \nну он и пристроился в очередь. заходит в домик, а там его два кавказца хватают, ебут в жопу и выкидывают на улицу. мужик оклемался слегка, приходит в себя, смотрит на огромную очередь и такой: \n— ААХАХАХААХАХАХАХА',
    'Ебет Эйнштейн Ньютона в сраку, а тот нарисовал на полу квадрат и посмеивается. \n- Хули смешного, сука бля? Я твою жопу ебу \n- Ты не мою жопу ебёшь) ты ебёшь ньютон на квадратный метр) ты ебешь Паскаля!\nПаскаль все это видел, отвернулся и обиделся.',
    'Пошел как-то раз дед в баню. И так распарился, что, надо же, - член встал.\nДед бегом в избу с криком:\n- Бабка! Бабка!\nВлетает в избу, а бабка на него вытаращилась, спрашивает:\n- Ты чего?\nДед орет:\n- Как чего?! Встал! Давай раздевайся скорее!\nБабка давай раздеваться, а член-то тем временем и упал. Расстроились оба, дед\nи предлагает: \n- Как следующий раз пойду в баню и увидишь, что бегу, так сразу задирай юбку и становись в позу.\nДоговорились. На следующий раз дед идет в баню, бабка у окна сидит - ждет. Вдруг\nвидит - дед летит, - задирает юбку, становится раком.\nДед влетает в избу и хрясь! Со всего маха бабке сапогом по жопе и как заорет: \n- Всё бы тебе ебаться, дура старая, а у нас там сарай горит!!!',
    'Заходит суровый огромный мужик в небольшое кафе\n\nТут к нему сразу подбегает официант с улыбкой и спрашивает:"чего желаете? "\n-У вас есть апельсины? -спрошивает мужчина. \nОфициант воскрикнул:"Конечно "\n-Ну тогда принесите мне огромную тарелку этих цитрусовых. \n\nОфициант убежал, и через несколько минут вернулся с огромной тарелкой, наполненой ярчайшими апельсинами. \nМужчина посмотрел на официанта, и жестом показал, что он может идти. \n\nЧерез несколько минут посетитель начинает чистить первый апельсин. Аккуратно почистив, мужчина с размаху кинул бедное цитрусовое о стену. Апельсин размазался и начал стекать со стены. Мужик взял второй апельсин и повторил процедуру. За вторым последовала все оставшиеся фрукты. Сидит мужчина напротив стены, измазаной апельсинами, думает. Тут к нему подбегает радостный официант с улыбкой на все лицо и спрашивает:"Вы случайно не мотоциклист? "\n\nМужик удивился и спрашивает: "Да, а как вы узнали? "\n\n-А вы на мотоцикле приехали',
    'Вернулся пожилой зек после 15-летней отсидки домой. Кореша его встречают\nи говорят типa:\n- Колян, ты за нас отсидел, нас не выдал, когда замели, все на себя взял,\nпоэтому мы тебе обязаны.. Вот купили тебе квартиру в центре 8-комнатную,\nдвухярусную.. все как надо, мебель шик, кароче сам оценишь, вот тебе\nеще машина шестисотый мерин, ну как у людей.. ну и красавица жена,\nфигура модели, а по хозяйству работящая-я-я... кароче, живи Колян себе\nв радость.\nЧерез две недели встречают Коляна, спрашивают:\n- Дескать, как там чо, есть нужда?\n- Да не, пацаны, все пучком.. хата - улет, машина тоже просто зверь, жена\nтоже телка ответственная, по хозяйству как надо разбирается во всем,\nпорножурналы мне сортир носит, когда я дрочу...\n- Погоди, погоди, а зачем журналы когда жена есть - ее ебать надо...\n- А за что ее ебать? Она же не косячит...',
    'В 2030-е годы мужик заполняет анкету и дошел до вопроса "Как спите?" Что писать? Напишешь "один" - пришьют инцельство. "С женой" - патриархат и гомофобию. "С мужчиной" - токсичную маскулинность. "С белыми" - расизм. "С черными" - культурную апроприацию. \nНаписал: "лежу пержу". \n\nДали десять лет за выбросы CO2.',
    'Доктор: просит выпить таблетки от шизофрении. \nПациент: докажите что они не отравлены. \nДоктор: выпивает. \nПациент: пропадает. \nДоктор: не понял.',
    'Одного парня заколдовала колдунья: он мог говорить только одно слово в год. И вот этот парень влюбился. Он 11 лет не говорил ни слова, потом подошёл к девушке и сказал: "Я..."\n\nСлова нельзя было накапливать.',
    'Женщина и её любовник находились в доме, пока муж был на работе. Её девятилетний сын вошел в комнату и, видя, как они занимаются любовью, спрятался в шкаф и оттуда подглядывал. Внезапно входит муж. Жена прячет любовника в шкаф, не зная, что её сын там.\nМальчик:\n––Темно здесь.\n––Да.\n— У меня есть футбольный мяч.\n— Это хорошо.\n— Вы не хотите его купить?\n–– Нет, спасибо.\n–– Мой отец снаружи.\n–– Ок, сколько?\n–– 250 долларов.\nСпустя несколько недель мальчик и мужчина снова встречаются в шкафу.\nМальчик:\n— Темно здесь.\n— Да.\n— У меня есть кроссовки.\nПомня, что случилось в прошлый раз, мужчина спрашивает:\n— Сколько?\n— 750 долларов.\n— Ок.\nСпустя несколько дней, отец говорит своему сыну:\n— Пойдем поиграем в футбол.\n— Я не могу, я продал мяч и кроссовки.\n— Сколько ты получил?\n— 1000 долларов.\n— Это ужасно! Как ты мог взять так много денег? Это намного больше, чем они стоят. Это грех, ты должен пойти в церковь и покаяться.\nОтец повел сына в церковь. Мальчик зашел в исповедальню, закрыл дверь и сказал:\n— Темно здесь.\nСвященник:\n— Бля, вот только не начинай опять с этой хуйни!',
    'В город приехал цирк. Афишы по всему городу:\n"Гачимучи-свинья!"\nВремя представления. Зал полон, люди смотрят шоу, аплодируют, но видно все ждут свинью. \n- А теперь на сцене гачимучи-свинья! - объявляет конферансье под шуш публики. \nНа сцену выходит обычный боров, за ним пьяный сторож, спрашивает:\n- Ты гачимучи свинья? \nИ пинает свинью со всех сил, а та:\n-<img alt="♂" class="emoji" src="/emoji/e/e29982.png"/>weeeee-weee<img alt="♂" class="emoji" src="/emoji/e/e29982.png"/>',
