    'Бережливые узбеки назвали своего сына Кешбек',
    'Иду по лесу… дождь херачит, ветер, ночь… замерз весь… смотрю — машина стоит, подхожу, в окошко смотрю — там никого. дверцу попробовал — открыто, ну я залез и сижу… вдруг машина поехала… я в ахуе… машина едет, я сзади сижу, за рулем никого… тут рука волосатая появляется откуда-то, порулила и исчезла… у меня волосы на жопе зашевелились… тут деревня показалась, вот уже дома первые… тут машина останавливается, в салон другой мужик заглядывает и говорит: \n— а ты че тут делаешь??? \n— да вот, еду… \n— Ахуеть просто!!! я толкаю, а он блять едет.',
    'Возвращается мужичок (М) из командировки и сдает отчет о своих расходах бухгалтеру:\n1. За проживание - 5000 руб.\n2. На питание - 2000 руб.\n3. На шл.. - 3000 руб.\nБухгалтер (Б) прочитала отчет и говорит:\nБ: Как же я буду проводить пункт 3, таких же расходов нет, ты что не мог написать как-то по-людски...\nМ: А как?\nБ: Ну вместо "На шл.." напиши "на забивание гвоздей"\nКороче, переписал, все уладилось. Проходит две недели, этот мужичок опять приезжает из командировки и приносит новый отчет:\n1. За проживание - 5000 руб.\n2. На питание - 2000 руб.\n3. На забивание гвоздей - 3000 руб.\n4. На ремонт молотка - 5000 руб.',
    'Жаль не взял собой фундук. Хе-хе. Сундук для шепелявых - фундук.',
    'Идут два грузина. Несут убитого медведя. Навстречу русский:\n- Ого, что за медведь? Гризли?\n- Эээ, дорогой, абижаещь. Пачиму загризли? Машину падажгли слющай',
    'Встала Красная Армия недалеко от деревеньки. Василий Иванович с Петькой сидят, скучают: \n— Петька, сгоняй в деревеньку, сообрази самогоночки, да побольше! \n— Это можно. \nЧерез час Петька возвращается. \n— Ну как? \n— Да нету в деревне нифига самогонки. \n— Эх, молодежь, всему вас учить надо. Пойдем вместе. \nПошли. заходят в первый дом с краю. Там дед сидит, на гармошке играет. Василий Иванович: \n— Здорово, отец! \n— Здорово, сынки! \n— Мы вот к тебе от имени Советской власти. \n— И чего хотели? \n— Эх, дед, пока мимо шли, гляжу, какая хата у тебя старая. \n— Ох, какая старая, сынки! \n— Петька, запиши — новую хату ему от Советской власти! \nДед гармошку отложил, заулыбался. А Василий Иванович продолжает: \n— Дед, а корова у тебя на дворе тоже, смотрю, какая старая! \n— Ох сынки и корова у меня старая, это верно! \n— Так, Петька, запиши — корову ему новую от Советской власти! \nДед по такому поводу давай гостей за стол приглашать: \n— Сынки! Родненькие! Да сколько ж я вас ждал! Давайте выпьем, да закусим! \nСели за стол, сидят, выпивают. Василий Иванович продолжает: \n— Дед, а жена у тебя тоже вроде старая? \n— Ой, какая старая, сынки, старушка уже! \n— Петька, запиши — жену ему новую от Советской власти! \nДед повеселел. В общем выпили, закусили, даже с собой взяли. Уже в дверях Василий Иванович как бы невзначай: \n— Слышь, дед! Ты сам-то тоже не молодой? \n— А то! Вы ж видите, старик уже. \n— Так, наверное у тебя и хуй уже старый? \n— Уж какой старый! \n— Петька, запиши — хуй ему от Советской власти!',
    'Штирлиц погладил кота. Кот сдох. Штирлиц удивился и поставил утюг на стол',
    'Приехал мужик домой, заходит на кухню.. а там пельмени его ждут',
    'После совещания у Сталина Жуков выходит и из двеpей кабинета\nи бpосает: ``Свинья усатая!`` Стоящий pядом с двеpью адьютант\nэто слышал и пошел к Сталину докладывать:\n- Товаpищ Сталин, вас товаpищ Жуков только что ``свиньей усатой``\nназвал!\n- Да!?! Позвать ко мне товаpища Жукова!\nВходит Жуков. Сталин ему:\n- Товаpищ Жуков, кого вы имели ввиду, когда выходя от меня\nвы сказали ``свинья усатая``?\n- Как кого? Гитлеpа!\n- А вы кого имели ввиду, товаpищ адьютант?',
    'Обидно что Я живу в обществе, где человек ловящий молнию считается дураком, а человек пытающийся отпиздить палкой ветер смельчаком.',
    'Как то раз на рынке идет мужик смотрит и думает какое ему животное домашнее купить \nКот банально, собака тоже\nВидит обезьяну подходит к продавцу не задумываясь покупает\nОдна неделя, вторая, третья и тут ему надоедает эта обезьяна и он решает ее продать, но еще и в выгоду себе (подороже чем брал) \nНо просто так за обычную обезьяну много не выручишь денег, и решил он ее научить говорить, в итоге научил говорить только одно слово КОНЕШНО\nПришел на рынок, поставил в два раза дороже ценник \nТут покупатель подходит и спрашивает--а что такая дорогая?\nМужик отвечает--а она слова знает! Сам спроси у нее\nПокупатель наклоняется и говорит--слова знаешь?\nОбезьяна--КОНЕШНО\nВ итоге покупатель не задумываясь берет ее и покупает, приходит домой и понимает что обезьяна только одно слово знает КОНЕШНО\nПошел на рынок продовать, поставил в три раза дороже\nПодходит покупатель и говорит--а что такая дорогая? Как будто из золота!\nПродовец--а она знает где клад находится!\nПокупатель--да ну!\nПродавец--сам спроси у нее \nПокупатель спрашивает обезьяну--знаешь где клад находится\nОбезьяна--КОНЕШНО\nПокупатель не задумываясь покупает ее \nПриходит домой, расстилает карту и пальцем показывает со словами--здесь клад?\nОбезьяна--КОНЕШНО\nМужик подрывается, собирает шмотки и летит с обезьяной\nПоказывет лопатой со словами--здесь копать?\nОбезьяна--КОНЕШНО\nКопает мужик час,два,три\nМужик--глубже копать?\nОбезьяна--КОНЕШНО\nВыкопал кратер и понимает что обезьяна знает только одно слово КОНЕШНО\nМужик спрашивает обезьяну\nМужик--тут клада нет?\nОбезьяна--КОНЕШНО\nМужик-по ебалу?\nОбезьяна--НЕНАДО',
    'Журналист приезжает в глухую деревню на Кавказе, чтобы снять репортаж про жизнь вдали от цивилизации. На улице абсолютная тишина, никого вокруг нет, только один дед сидит у дерева\n- Дедушка, слушайте, вы же тут всю жизнь живёте, да?\n- Канешно, дарагой, вот уже 70 лет как тут жыву\n- А можете интересную историю из жизни рассказать?\n- Ой, дарагой, помню, лет пять назад у саседа потерялся в горах казёл. День искали, два искали, третий день нашли казёл, всей деревней его ебали!\nРепортёр понимает, что он никак не может использовать эту историю.\n- Не, другая история нужна. Может у вас есть веселая история?\n- Да без проблем, дарагой! Вот буквально год назад у саседа в горах потерялся жена. День искали, два искали, третий день нашли жена, всей деревней её ебали!\nРепортёр уже начитает терять надежду и решает в последний раз попробовать вытянуть из старика нормальную историю\n- Черт, да может какая-нибудь грустная история есть?\nСтарик стразу бледнеет, широкая улыбка сходит с его лица, а глаза становятся будто стеклянными.\n- Однажды я патерялся в горах...',
    'Гена с Чебурашкой сидят в тюремной камере.\nСидящий по соседству зэк, обращается к ним с вопросом:\n– За что вас загребли?\n– За фокусы, – отвечает Чебурашка.\n– За какие?\n– Ну хочешь, чтоб у тебя хуй до пола был?\n– Хочу!\n– Гена, откуси ему ноги',
    'Гитлер пошёл к гадалке и спросил её: "В какой день я умру?". Провидица заверила его, что он умрёт в еврейский праздник.\n— Почему вы так уверены в этом? - усомнился Гитлер.\n— Любой день, в который ты умрёшь, будет еврейским праздником. - ответила она',
    'Умирает Барак Обама и попадает в ад. Ну, там Люцифер стоит, долго ищет чëрного экс-президента в списке, затем, почесав красную лысину, протяжно сказал:\n- Тебя, похоже, не в тот ад отправили.\n- Чего? - удивился Обама. - Ад же для людей, - тыкая на табличку, продолжал он.\nЛюцифер горько вздохнул, а затем ответил:\n- Был бы ты человеком нахуй!..',
    'Поручик Ржевский спрашивает у корнета: -Корнет, вы имеете такой успех у дам. расскажите, как у вас это получается? \n- а вы подойдите к даме, скажите ей что-нибудь остренькое, затем что-нибудь скользкое, затем пошленькое и представьтесь. И она ваша. \nНа балу поручик подходит к даме и говорит: \n-Шило, мыло, хуй. Поручик Ржевский.',
    'Крутой джазовый бар проводит конкурс на лучшего исполнителя, которого возьмут на работу. Собирается толпа музыкантов и среди них старый негр.\n\nВыходит и говорит:\n\n— Эта песня называется "Я буду дрочить на тебя всю ночь!"\n\nИграет восхитительный блюз, после которого половина музыкантов сразу собираются и уходят, другие просто плачут от восторга!\n\nСтарый негр говорит:\n\n— А следующая моя песня называется "Соси у меня, сука, пока я не кончу!"\n\nИ играет блюз еще круче от которого оставшиеся музыканты единогласно отказываются от участия в конкурсе.\n\nВладелец заведения говорит\n\n— Мы вас берем, только не могли бы вы не называть своих песен, а они немного… нуу... шокируют.\n\nНегр соглашается.\n\nИдет очередной концерт, негр забыл заправиться, и у него елда торчит из штанов. Он садится за рояль, играет. Хозяин заведения замечает эту оплошность, подходит к нему, говорит:\n\n— У тебя хуй видно, знаешь?\n\nНегр:\n\n— Что? Знаю ли я её?! Да я её написал!',
    'В дверь не стучали\n- Ник Вуйчич! - догадался Штирлиц.',
    'Хорошего бухгалтера найти трудно, поэтому Вера Павловна уже двадцать лет числится в федеральном розыске.',
    'Басист бегает по дому за дитем: \n- Сука, поймаю - руки поотрываю! \nЖена испуганно: \n- Вась, че такое? \n- А он мне струну расстроил, а какую - не говорит!',
    'Встретились два человека на том свете.\n– Ты вот как умер?\n– С крыши небоскреба спрыгнул, а что?\n– Смотреть надо куда летишь, 6лять!',
    '-Саш, а что тебе нравится в девушках?\n-ну как, грудь и попа\n-а, то есть, на лицо тебе насрать?\n-не надо',
    'Едут в купе три женщины и грузин. Одна говорит: \n- Меня испортили лежа - значит, я положительная женщина. \nДругая: \n- Меня испортили стоя - значит, я стоящая женщина. \nТретья: \n- Меня испортили раком - значит, я роковая женщина. \nГрузин: \n- А вот меня испортили на мешке с изюмом, что же теперь, по-вашему, я - изюмительный мужчина?',
    '"Изя сыночек, высылаем тебе пятьсот рублей, как ты и просил. Кстати, 500 рублей пишется с двумя нулями, а не с тремя"',
    'Медведь попал в жуткую аварию и чудом выжил. «Чудес не бывает», — подумал Медведь  и залез обратно в горящую машину.',
    'Обходит мент пришедшую электричку. Смотрит — студентик заснул, а на коленях книга: — Ландау. Теория поля. Мент хлопает студента по плечу и говорит: — Вставай, агроном —приехали.',
    'Урок в военной академии. Прапор диктует:\n— Угол поднятия башни танка равен 30 градусов.\nВопрос из аудитории:\n— Извините, а 30 градусов это по Цельсию или по Фаренгейту?\nПрапор, почесав затылок:\n— Конечно же по Цельсию.\nВ аудитории дружный хохот. Прапор, покраснев говорит:\n— Ну, уж и пошутить нельзя, конечно же по Фаренгейту!',
    'Тайная вечеря в самом разгаре. Входит запоздавший Иисус и, в изумлении, застывает в дверях. В доме - страшный беспорядок, все пьяные, грязно... \nВ ужасе Иисус хватает первым подвернувшегося под руку Петра:\n- Пётр, что происходит?! \n- П-п-пьём...\n- А деньги где взяли?!\n- А-а-а... Да там Иуда что-то продал.',
    '- Тараканы в доме есть? \n- Нет, их пауки съели. \n- У Вас пауки есть? \n- Нет, их крысы съели. \n- У Вас крысы есть?! \n- Нет, их Валентин Геннадьевич Белов съел. \n- А кто это? \n- Забыл представиться.',
    '- Мыкола, а я в Москву прийихав и на Красной Площади насрав!\n- И шо? Москали не заметили? \n- Та я по-тыхому, шаровар не снымая....',
    'Почему не существует обзоров на наркотики. Отсутствуют независимые эксперты.',
    'Однажды в ресторане поручик Ржевский встретился с полковником.\nПолковник говорит:\n–Поручик, вы, я вижу, частенько в ресторан ходите – чуть ли не\nкаждый день. А у меня вот на такие дела денег не хватает.\n–А вы, – спрашивает поручик, - что с жалованием делаете, как получите?\n–Да все жене отдаю, а там – что она мне выдаст, то и мое.\n–Э-э-э, – говорит поручик, – вы с женщинами не умеете обращаться.\nПодойдите к ней, в шейку поцелуйте, за плечико возьмите, она вам и даст денежек.\nПриходит полковник домой – и все, как поручик сказал, так и сделал:\nподошёл сзади, целует в шею, а она и говорит:\n–Что, поручик, опять деньги кончились?',
    'Ковбой приехал в Израиль. Однажды в баре он говорит: \n— Всем виски за мой счет! \nИ вдруг все оттуда разбежались. \nОн бармену: \n— А что я не так сказал? Бармен: \n— Все в порядке, это они за родственниками...',
    'Идет бухой мужик, шатается.\nВдруг чувствует сильный удар в спину.\nОборачивается, а это асфальт.',
    'Иду по улице два экстрасенса. Один говорит:\n- Хочешь, я силой мысли заставлю выкинуть из того окна телевизор?\nПоспорили.\nУперся он взглядом в окно... Оттуда через 20 сек. вылетает стиральная\nмашинка.\n- ?!?\nУперся еще пристальней... Через 20 сек. вылетает швейная машинка.\n- ?!?\nУперся совсем пристально... Вылетает холодильник.\n- ???!???\nВгляделся до боли в глазах. Высовывается мужик:\n- Да нету у меня телевизора, НЕТУ!!!',
    'Два друга таджика решили жениться на русских близняшках. Пошли они значит к их отцу просить разрешение, а отец им и сказал: "Дочерей отдам замуж только крещенным христианам". \nНу базару нет, подумали таджики и решили пойти на крещение господня. Мороз, озеро, купель русская... Решается один из таджиков окунуться, раз окунается, два... Ему уже и крестик несут... \nВторой мёрзнет, да спрашивает: \n— Не холодно ли тебе, братан? \nА тот ему и говорит: \n— Иди нахуй чурка.',
    'Идут два сантахника по улице, один уже опытный, а второй стажер. Вдруг видят, посреди улицы говно из люка хлыщет во все стороны. Ну они не растерялись, подбежали, опытный сантехник нырнул в дерьмо, через время всплывает и говорит молодому:\n- Ключ на 14 дай!- стажер дал. Опытный опять нырнул. Через время опять всплывает:\n-Дай теперь ключ на 18! - Стажер опять дал.\nСпустя минуту говно перестает течь. Опытный сантехник всплывает и говорит стажеру:\n- Учись стажер! А то так всю жизнь и будешь ключи подавать!',
    '- У моей большие сиськи!\n- А у моей классная задница!\n"А у моей огромный член", - подумал Олег, но хвастаться не стал.',
    'Один мальчик пожелал что бы у него был день рождения каждый день и через два месяца состарился и умер.',
    'Один римлянин говорит другому:\n— Знал бы ты, со сколькими женщинами я спал!\n— ммм?..\n— Ну поменьше, конечно...',
    'Белка-летяга за всю свою жизнь так ни разу никуда и не слетала. Хотя и планировала',
    'Сидят у костра трое: английский морской котик, американский зеленый берет и наш десантник. Выпивают, закусывают. Изрядно набравшись, английский морской котик встает и заявляет:\n– Я могу проплыть 100 метров под водой, сразиться со взводом врага, отстрелять 50 из 50 по-македонски и вернуться живым тем же путем:\nТут встает американский зеленый берет:\n– Это все хуйня. Я могу проплыть 200 метров под водой, сразиться с ротой врага, отстрелять 100 из 100 по-македонски и вернуться живым тем же путем:\nНичего не ответил русский десантник. Он просто встал и молча пошевелил хуем угли.',
    'К мужику-патологоанатому привозят труп молодой, красивой девушки. Видит он её и думает: «может выебать разочек, всё равно один раз живём?». Так и сделал. Трахнул, помыл, зашил и отдал на захоронение. И этой же ночью она к нему приходит во сне и говорит: «Приди на кладбище, раскопай меня и выеби ещё раз, удача тебя ждёт тогда». Ну мужик думает: «Нет, то была ошибка, я же человек а не зверь, не буду я этого делать». С тех пор каждую ночь эта девушка приходила к нему во сне и просила о том же. Неделю терпит мужик, вторую, на третьей сдался. Ночью идёт на кладбище с лопатой, раскапывает, достаёт из гроба и ебёт всю ночь. Под утро возвращаешься домой, а по пути 50 рублей нашёл...',
    'Было у отца два сына. Вот решил отец купить им по одной лошади. Сели довольные и поехали в поле кататься. Вернулись и тут один из них говорит мол слушай, а как мы их будем различать? Другой подумал и говорит - давай мол я своей ухо отрежу. Твоя будет с двумя ушами, а моя с одним. Сделали и пошли спать. А сосед всё подслушал, ночью пришел и отрезал ухо первой лошади. На другой день пришли сыновья, смотрят - обе лошади без одного уха. Как же мы их будем различать - молвит первый. Окей, говорит второй, давай я своей хвост отрежу. Твоя с хвостом, моя без. И пошли спать. Сосед опять всё подслушал, ночью пришел и отрезал хвост другой лошади. На следующий день пришли сыновья, смотрят - обе лошади без хвостов. Как же мы их различать то будем - спросил первый? Другой подумал и говорит - а давай твоя будет белая лошадь, а моя черная.',
