    'Приходит мужик в магазин головных уборов и говорит:\n— Мне нужна лучшая шляпа, что у вас есть.\nПродавец протягивает мужику красивую шляпу, а мужик в ответ:\n— Но она ведь будет мне велика!\n— Не волнуйтесь, это ведь лучшая шляпа - она подстроиться под размер вашей головы. \nИ действительно, мужик надел шляпу, а та стянулась идеально, так еще и фасон нужный приняла. Ну мужик довольный покупает шляпу. Приходит он домой и нарадоваться не может, вертит шляпу, и вдруг надевает ее на руку, и шляпа тут же стягивается в красивую перчатку, надел на ногу - превратилась в носок. И тут у мужика возникла грязная идейка... Вот он уже надевает ее на член...\nИ ВЫ НЕ ПОВЕРИТЕ ТОВАРИЩ СУДЬЯ, ШЛЯПА ПРЕВРАЩАЕТСЯ В ДВЕНАДЦАТИЛЕТНЕГО МАЛЬЧИКА!',
