    'Случай в больнице. Один богач после аварии потерял много крови и ему срочно требовалось переливание. Но у него была очень редкая группа крови, поэтому врачи не могли найти подходящую. Молодой врач вышел в коридор больницы и сказал:\n— Одному богачу требуется переливание очень редкой группы крови, есть среди вас кто-то, кто может пожертвовать её во имя спасения жизни?\nНа лавочке сидел молодой еврей и думал:\n— А почему бы, собственно, не согласиться? Раз-таки богач, то за спасение своей жизни может дать что-то непомерно ценное, а такую выгоду упускать нельзя.\nПосле успешного переливания богач обращается к еврею:\n— Спасибо тебе, добрый человек. За то что ты спас меня я отдам тебе свой дом на берегу моря.\nПять лет еврей жил там и не знал горя, но однажды ему снова пришлось прийти в ту же больницу, где тот же самый богач снова попал в аварию и ему нужно было переливание редкой группы крови.\nЕврей подумал:\n— Таки что же, второй раз можно очень хорошо нажиться на своём организме.\nИ согласился сделать переливание. После успешной операции богач подходит к еврею и говорит:\n— Молодой человек, вот уже второй раз вы спасаете мою жизнь. За это я отдам вам недоеденную шоколадку.\nЕврей удивляется:\n— Я, конечно, крайне признателен вам, но почему в тот раз был-таки дом, а сейчас какая-то шоколадка?\n— Все просто: раньше во мне-таки не было еврейской крови — ловко парировал богач.',
    'Попадают в ад бабник , торчок и алкоголик , на входе в ад их приветствует Сатана и говорит :\n- Я верну вам жизнь если вы поведете каждый по сто лет в комнате со своими самыми сильными желаниями, если вы его не пройдете, Я заберу вашу душу \n \nБабник попадает в роскошную комнату с множеством красивых женщин жаждущих любви \n\nАлкоголик попадает в комнату с 100 летним запасом  алкоголя всех видов\n\nТорчок попадает в комнату где тонны самой качественной травки \n\nПроходит 60 лет и Сатана решает проверить испытуемых \n\nВходит в комнату к бабнику и наблюдает как за вечно молодым бабником все так же бегают женщины но постаревшие на 60 лет , бабник молит избавить его от таких мучений и Сатана забирает его душу \n\nДалее Сатана открывает комнату с алкоголиком и видит что алкоголик выпил весь запас алкоголя в первый месяц испытания и страдает от вечного похмелья . Испытание провалено ,Сатана забирает душу алкоголика .\n\nОстаётся последняя комната с торчком . Сатана открыв двери сильно удивился - ни один грамм травы не был тронут . На входе  стоит торчок и говорит Сатане :\n\n- Ты бы хоть зажигалку оставил дол6аёб ....',
