    'Едут хохол с негром в поезде. Негру захотелось поесть и он достал бананы и начал есть их. Хохол никогда не видел бананов и спросил негра\n– Що це?\n– Бананы\n– Дай попробовать\nНегр и хохол поели бананов и едут дальше. Вдруг хохлу опять захотелось есть. Он достал сало и начал его есть. Негр, который никогда не видел сало спросил хохла:\n– Что это?\n– Сало\n– Дай попробовать\n– Сало как сало, чё его пробовать то?',
